INSERT INTO `ci_hotel_translate` (`hott_id`, `hott_hotel_id`, `hott_lang`, `hott_name`, `hott_url`, `hott_short_description`, `hott_description`, `hott_detail`, `hott_included`, `hott_remark`, `hott_cr_date`, `hott_cr_uid`, `hott_lu_date`, `hott_lu_uid`) VALUES
(22, 9, 'th', 'โรงแรมเอส.บี.ลิฟวิ่งเพลส', 'โรงแรมเอส-บี-ลิฟวิ่งเพลส', 'เอส.บี.ลิฟวิ่งเพลส เปิดบริการด้วยห้องพักจำนวน 59 ห้อง ห้องพักสะอาด สะดวกสบาย ทุกอย่างตกแต่งด้วย สไตล์บูติกที่ทันสมัย หรูหรา โอ่อ่า', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style="font-size: x-large;"><strong>&nbsp;เอส.บี.ลิฟวิ่งเพลส</strong></span> เปิดบริการด้วยห้องพักจำนวน 59 ห้อง ห้องพักสะอาด สะดวกสบาย ทุกอย่างตกแต่งด้วย สไตล์บูติกที่ทันสมัย หรูหรา โอ่อ่า&nbsp;มีห้องประชุมสัมมนาสะดวก นวดผ่อนคลาย ห้องออกกำลังกาย และห้องอาหารมากมาทั้งอาหารพื้นเมืองและ Seafood สดๆ ให้ท่านได้ลิ้มลอง บรรยากาศเงียบสงบเหมาะแก่ท่านที่ต้องการความเป็นส่วนตัวพร้อมที่จอดรถสะดวกสบาย ท่านจะได้รับบริการจากพนักงานของเราด้วยความเป็นมิตร พร้อมที่จะคอยให้บริการคุณด้วยความเต็มใจ</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wi-Fi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>ลิฟท์</p>\n</li>\n<li>\n<p>ห้องประชุม</p>\n</li>\n<li>\n<p>สระว่ายน้ำ(สำหรับเด็ก)</p>\n</li>\n<li>\n<p>สวน</p>\n</li>\n<li>\n<p>ฟรี wi-fi</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n<li>\n<p>สปา</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-12 14:46:42', NULL, '2013-02-18 10:18:28', NULL),
(23, 10, 'en', 'Motive Cottage Resort', 'motive-cottage-resort', 'The Motive Cottage Resort, situated a 10 minutes’ walk from Bang Niang Beach', '<p style="padding-left: 30px;"><strong><span style="font-size: x-large;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The Motive Cottage Resort</span></strong>, situated a 10 minutes&rsquo; walk from Bang Niang Beach, offers Thai-style rooms with private balconies and an outdoor swimming pool in a tropical garden setting.Rooms at the Motive Cottage feature white bed linens and a reading table. Each air-conditioned room overlooks the pool and is equipped with cable TV.Local Thai cuisine is served in the Motive Resort&rsquo;s open-air restaurant. Massage services are available at the resort, as is bicycle or car rental.Guests can book an excursion to the Similan Islands at the Motive&rsquo;s tour desk.Khao Lak/Lam Ru National Park is located less than 7 km from the Motive Cottage Resort. Phuket International Airport is a one-hour drive away.</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">Facilities&amp;Services</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>airport transfer</p>\n</li>\n<li>\n<p>bicycle rental</p>\n</li>\n<li>\n<p>laundry service/dry cleaning</p>\n</li>\n<li>\n<p>tours</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>pool (kids)</p>\n</li>\n<li>\n<p>Free WiFi access</p>\n</li>\n<li>\n<p>massage</p>\n</li>\n<li>\n<p>outdoor pool</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-12 14:55:51', NULL, '2013-02-15 10:51:40', NULL),
(24, 10, 'th', 'โรงแรมโมทีฟ คอตเท็จรีสอร์ท', 'โรงแรมโมทีฟ-คอตเท็จรีสอร์ท', 'โมทีฟ คอตเท็จรีสอร์ท ห่างจากหาดบางเนียงโดยใช้เวลาเดินเพียง 10 นาที ที่นี่ให้บริการห้องพักสไตล์ไทยพร้อมระเบียงส่วนตัว', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong><span style="font-size: x-large;">โรงแรมโมทีฟ คอตเท็จรีสอร์ท</span></strong>&nbsp;ห่างจากหาดบางเนียงโดยใช้เวลาเดินเพียง 10 นาที ที่นี่ให้บริการห้องพักสไตล์ไทยพร้อมระเบียงส่วนตัว และสระว่ายน้ำกลางแจ้งภายในสวนเขตร้อนห้องพักที่ Motive Cottage มีชุดผ้าเครื่องนอนสีขาว โต๊ะอ่านหนังสือ เครื่องปรับอากาศ วิวสระว่ายน้ำ และเคเบิลทีวี&nbsp;อาหารไทยพื้นบ้านมีให้บริการที่ห้องอาหารแบบเปิดโล่งของ Motive Resort นอกจากนี้ รีสอร์ทยังมีบริการนวด บริการให้เช่าจักรยาน และบริการรถเช่า ท่านสามารถจองทริปท่องเที่ยวไปยังเกาะสิมิลันได้ที่โต๊ะบริการทัวร์ของ Motive.Motive Cottage Resort ห่างจากอุทยานแห่งชาติเขาหลัก-ลำรู่ไม่ถึง 7 กิโลเมตร และห่างจากสนามบินนานาชาติภูเก็ต 1 ชั่วโมงหากเดินทางโดยรถยนต์</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wi-Fi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>สระว่ายน้ำ (สำหรับเด็ก)</p>\n</li>\n<li>\n<p>ฟรี WiFi</p>\n</li>\n<li>\n<p>จักรยานให้เช่า</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>บริการรถรับ-ส่งถึงสนามบิน</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-12 14:59:24', NULL, '2013-02-18 09:34:06', NULL),
(9, 1, 'th', 'บ้านรายารีสอร์ทแอนด์สปา', 'บ้านรายารีสอร์ทแอนด์สปา', 'บ้านรายา เป็นรีสอร์ท ที่อยู่บนเกาะราชาใหญ่ ตั้งอยู่ทางใต้ของเกาะภูเก็ตในทางภาคใต้ของชายฝั่งตะวันตกของประเทศไทย. ', '<p style="padding-left: 30px;"><span lang="th">&nbsp; &nbsp; &nbsp; &nbsp;<span style="font-size: x-large;"><strong> บ้านรายา</strong></span></span>&nbsp;<span lang="th">เป็นรีสอร์ท ที่อยู่บนเกาะราชาใหญ่ ตั้งอยู่ทางใต้ของเกาะภูเก็ตในทางภาคใต้ของชายฝั่งตะวันตกของประเทศไทย. รีสอร์ท ของเราตั้งอยู่ตรงจุดดำน้ำเดินเพียงแค่ 2 นาที และตั้งอยู่ตรงจุดที่สามารถเล่นน้ำได้เดินเพียงแค่ 20 นาที และ รีสอร์ท&nbsp; ของเราตั้งห่างจากชายหาดหลักและท่าเรือ&nbsp;</span>เกาะราชาใหญ่ เป็นเกาะที่มีธรรมชาติที่สวยงาม. เป็นสถานที่เหมาะกับการหนี้การจารจรที่แออัดตามเมื่องใหญ่เพราะเกาะราชาใหญ่ไม่มีถนนจึงไม่มีการจราจรที่ติดขัด. เกาะราชาใหญ่เป็นเกาะเล็กๆ จึงง่ายที่จะเดินไปทั่วๆเกาะ บ้านรายา ตั้งอยู่บนเนื้อที่ 151.8 ไร่ อยู่ทางตะวันออกเฉียงใต้ของเกาะราชาใหญ่. รีสอร์ทตั้งอยู่บนแหลมและตัวรีสอร์ท ยื่นลงไปทั้งสองฝั่งอ่าว. อ่าวแรกอ่าวคนแคะ เป้นจุดที่ดำน้ำที่ดีที่สุดในภูมิภาค และ อ่าว เธอ เป้นหาดทรายสีขาวที่สวยงามเป้นจุดที่เหมาะสำหลับเล่นน้ำและว่ายน้ำ</p>\n<p style="padding-left: 30px;">&nbsp;</p>', '<table border="0">\n<tbody>\n<tr>\n<td>\n<p><strong><span style="font-size: large;">Deluxe Pavilion</span></strong></p>\n</td>\n<td>&nbsp;<strong style="font-size: large;"><strong>Deluxe</strong></strong></td>\n</tr>\n<tr>\n<td><img src="http://www.banraya.com/images/room_deluxepavilion_main.jpg" alt="" width="279" height="263" /></td>\n<td><img src="http://www.banraya.com/images/room_deluxe_main.jpg" alt="" width="247" height="252" /></td>\n</tr>\n<tr>\n<td>\n<p><span style="font-size: large;"><strong>Superior</strong></span></p>\n</td>\n<td>&nbsp;<strong><span style="font-size: large;">Standard</span></strong></td>\n</tr>\n<tr>\n<td><img src="http://www.banraya.com/images/room_superior_main.jpg" alt="" width="279" height="252" /></td>\n<td><img style="-webkit-user-select: none;" src="http://www.banraya.com/images/room_standard_main.jpg" alt="" /></td>\n</tr>\n</tbody>\n</table>\n<table border="0">\n<tbody>\n<tr>\n<td colspan="2">\n<p><span style="font-size: xx-large;"><strong>สิ่งอำนวยความสะดวก</strong></span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wifi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>บริการพี่เลี้ยงเด็ก</p>\n</li>\n<li>\n<p>บาร์/ผับ</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>ห้องประชุม</p>\n</li>\n<li>\n<p>จักรยานให้เช่า</p>\n</li>\n<li>\n<p>บาร์ริมสระน้ำ</p>\n</li>\n<li>\n<p>ร้านเสริมสวย</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>ร้านค้า</p>\n</li>\n<li>\n<p>คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>บริการรรับส่ง-ส่งถึงสนามบิน</p>\n</li>\n<li>\n<p>พนักงานต้อนรับ</p>\n</li>\n<li>\n<p>กีฬาทางน้ำ</p>\n</li>\n<li>\n<p>ชายหาดส่วนตัว</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>สปา</p>\n</li>\n<li>\n<p>สระว่ายน้ำ(สำหรับเด็ก)</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n<li>\n<p>สวน</p>\n</li>\n<li>\n<p>ฟรี Wifi ภายในห้องพัก</p>\n</li>\n<li>\n<p>ฟรีLAN (อาจเสียค่าใช้จ่ายในบางห้องพัก)&nbsp;</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>ราคาจะมีการเปลี่ยนตามฤดุกาลท่องเที่ยว ราคาปัจจุบันใช้ตั้งแต่วันนี้จนถึงเดือนเมษายน</p>\n<p>&nbsp;</p>', '', '', '2013-02-07 10:53:29', NULL, '2013-02-14 14:15:03', NULL),
(10, 1, 'en', 'Ban Raya Resort&spa', 'ban-raya-resort-amp-spa', 'Raya Yai or Racha Yai Island is the major island in Andaman Sea; the one of the most beautiful tropical islands in the world', '<p style="padding-left: 30px;">&nbsp; &nbsp; <strong><span style="font-size: x-large;">&nbsp;Raya Yai or Racha Yai Island</span></strong> is the major island in Andaman Sea; the one of the most beautiful tropical islands in the world with fantastic beaches and unspoiled coral reef which situated 23 km far from South of Phuket island. It is the ideal place to get away from places which are busy from tourist destination and also suitable for those who love a solitary life with the touch of peacefulness. There are no roads and hence no traffic so walking is easy and enjoyable.</p>\n<p style="padding-left: 30px;">&nbsp;Ban Raya Resort &amp; Spa located on a private property set among 60 acres of coconut palm and lush tropical garden right beside Kon Kare Bay; the best coral reefs of the island where offers 48 high standards of cleanliness bungalows with electric fan or air-conditioning in a friendly atmosphere. All the rooms have own bathroom, mosquito screen and balcony. None of the rooms are more than two minutes walk from the seafront (Kon Kare Bay). In Ban Raya Resort you can enjoy your own privacy far from the crowds</p>\n<p>&nbsp;</p>', '<table border="0">\n<tbody>\n<tr>\n<td>\n<p><span style="font-size: x-large;"><strong>Deluxe Pavilion</strong></span></p>\n</td>\n<td><span style="font-size: x-large;">&nbsp;<strong>Deluxe</strong></span></td>\n</tr>\n<tr>\n<td><img src="http://www.banraya.com/images/room_deluxepavilion_main.jpg" alt="" width="279" height="263" /></td>\n<td><img src="http://www.banraya.com/images/room_deluxe_main.jpg" alt="" width="247" height="252" /></td>\n</tr>\n<tr>\n<td>\n<p><strong><span style="font-size: x-large;">Superior</span></strong></p>\n</td>\n<td><strong><span style="font-size: x-large;">&nbsp;Standard</span></strong></td>\n</tr>\n<tr>\n<td><img src="http://www.banraya.com/images/room_superior_main.jpg" alt="" width="279" height="252" /></td>\n<td><img src="http://www.banraya.com/images/room_standard_main.jpg" alt="" /><br /><br /></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<table border="1">\n<tbody>\n<tr>\n<td style="background-color: #ffffcc;" colspan="2">\n<p><span style="font-size: x-large;"><strong>Facilities</strong></span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Bar/pub</p>\n</li>\n<li>\n<p>restaurant</p>\n</li>\n<li>\n<p>Salon</p>\n</li>\n<li>\n<p>Airport transfer</p>\n</li>\n<li>\n<p>Bicycle rental</p>\n</li>\n<li>\n<p>Coffee shop</p>\n</li>\n<li>\n<p>Laundey service/Dry cleaning</p>\n</li>\n<li>\n<p>Room service</p>\n</li>\n<li>\n<p>Shops</p>\n</li>\n<li>\n<p>Tours</p>\n</li>\n<li>\n<p>Babysitting</p>\n</li>\n<li>\n<p>Concierge</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>Meeting facilities</p>\n</li>\n<li>\n<p>Poolside bar</p>\n</li>\n<li>\n<p>Safety deposit boxes</p>\n</li>\n<li>\n<p>Wi-fi in public areas</p>\n</li>\n<li>\n<p>Massage</p>\n</li>\n<li>\n<p>Out door pool</p>\n</li>\n<li>\n<p>Pool(kinds)</p>\n</li>\n<li>\n<p>Garden</p>\n</li>\n<li>\n<p>Spa</p>\n</li>\n<li>\n<p>Water sports (non-motorized)</p>\n</li>\n<li>\n<p>Free Wifi access</p>\n</li>\n<li>\n<p>Free LAN access (maybe charged in some rooms)</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', '', '2013-02-07 12:40:04', NULL, '2013-02-14 16:54:03', NULL),
(21, 9, 'en', 'S.B. Living Place', 's-b-living-place', 'S.B. Living Place has 59 rooms for you selection. It has a swimming pool, garden,Paradise restaurant,Karaoke, meeting room, Massage, Fitness and Restaurant & Bar.', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style="font-size: x-large;"><strong>S.B. Living Place</strong></span> has 59 rooms for you selection. It has a swimming pool, garden,Paradise restaurant,Karaoke, meeting room, Massage, Fitness and Restaurant &amp; Bar.&nbsp;All are beautifully&nbsp;decorated "Modern boutique style" with modern facilities and full amenities and big car park.With our hospitality staffs ready to provide your five star service. &nbsp;S.B. Living Place is a boutique in Phuket Town and located in the heart of Phuket business and Shopping center, Surrounded by an Entertainment complex, Karaoke, Approximately 30 mins to Phuket international Airport, 10 mins to Phuket station, 5 mins to Central Festival Phuket Shopping.5 mins to Old Town Phuket and 20 mins to Patong beach, Kata beach, Karon beach.</p>\n<p style="padding-left: 30px;">&nbsp;</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">Facilities&amp;Services</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>restaurant</p>\n</li>\n<li>\n<p>Free WiFi access</p>\n</li>\n<li>\n<p>car park</p>\n</li>\n<li>\n<p>coffee shop</p>\n</li>\n<li>\n<p>elevator</p>\n</li>\n<li>\n<p>room service</p>\n</li>\n<li>\n<p>tours</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>outdoor pool</p>\n</li>\n<li>\n<p>meeting facilities</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n<li>\n<p>garden</p>\n</li>\n<li>\n<p>pool(kids)</p>\n</li>\n<li>\n<p>spa</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-12 14:34:11', NULL, '2013-02-15 11:02:01', NULL),
(11, 2, 'th', 'โรงแรมบูกิตตา โฮเต็ล แอนด์ สปา ภูเก็ต', 'โรงแรมบูกิตตา-โฮเต็ล-แอนด์-สปา-ภูเก็ต', 'บูกิตตาโรงแรมและสปา ตั้งอยู่ในใจกลางเมืองภูเก็ตการเดินทางสะดวกสบาย รายล้อมด้วยกิจกรรมมากมาย ทั้งการท่องเที่ยวในย่านเมืองเก่า, การจับจ่ายใช้สอยในห้างสรรพสินค้า', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; <span style="font-size: x-large;"><span style="font-size: xx-large;">บูกิตตาโรงแรมและสปา</span>ตั้งอยู่ในใจกลางเมืองภูเก็ตการเดินทางสะดวกสบาย </span>รายล้อมด้วยกิจกรรมมากมาย ทั้งการท่องเที่ยวในย่านเมืองเก่า, การจับจ่ายใช้สอยในห้างสรรพสินค้า, ศูนย์การค้า, รวมถึงสถานบันเทิงยามค่ำคืน โรงแรมแห่งนี้ผสมผสานความเป็นไทยร่วมสมัยและสภาพแวดล้อมตามธรรมชาติได้อย่างลงตัว บูกิตตาโรงแรมและสปา มี 86 ห้องพัก พร้อมกับสิ่งอำนวยความสะดวกเต็มรูปแบบที่เหนือกว่า พร้อมให้ความพึงพอใจสูงสุดแก่ท่าน มั่นใจว่าด้วยอาหารเลิศรสและสปาสุคนธบำบัดสุดวิเศษของโรงแรม จะเติมเต็มวันหยุดของท่านให้สมบูรณ์แบบน่าจดจำ</p>', '<table border="0">\n<tbody>\n<tr>\n<td style="text-align: center;" colspan="2">\n<p><strong><span style="font-size: x-large;">ข้อมูลบริการและสิ่งอำนวยความสะดวก</span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>&nbsp;บริการต้อนรับ 24 ชั่วโมง</p>\n</li>\n<li>\n<p>บริการรักษาความปลอดภัย 24 ชั่วโมง</p>\n</li>\n<li>\n<p>บริการรับ ส่ง สนามบิน</p>\n</li>\n<li>\n<p>เคาน์เตอร์พนักงานยกกระเป๋า</p>\n</li>\n<li>\n<p>บูกิตตาสปาและห้องเซาว์น่า</p>\n</li>\n<li>\n<p>พื้นที่จอดรถ</p>\n</li>\n<li>\n<p>หนังสือพิมพ์รายวัน (บริเวณล็อบบี้เลาจ์น)</p>\n</li>\n<li>\n<p>บริการแลกเปลี่ยนเงินตราระหว่างประเทศ</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>ห้องคาราโอเกะ</p>\n</li>\n<li>\n<p>โทรศัพท์สายตรงระหว่างประเทศ</p>\n</li>\n<li>\n<p>สัญญาณอินเตอร์เน็ตไร้สาย</p>\n</li>\n<li>\n<p>บริการซัดรีด</p>\n</li>\n<li>\n<p>บริการเสริฟ์อาหารเครื่องดื่มถึงห้อง 06.00 น. - 24.00 น.</p>\n</li>\n<li>\n<p>ห้องประชุมขนาดเล็ก</p>\n</li>\n<li>\n<p>โต๊ะบริการทัวร์เเละการเดินทาง</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p><strong>ห้องอาหารเเละบาร์:</strong></p>\n<p>ผู้ที่รักอาหารสามารถเพลิดเพลินได้อย่างเต็มที่ไปกับอาหารพื้นบ้านที่มีมา ให้เลือกมากมายหลายประเภท ทั้งอาหาร ไทย นานาชาติ บาร์บีคิวอาหารทะเล สามารถพบสถานที่ที่น่าตื่นตาที่จะนั่งและเพลิดเพลินไปกับอาหารทะเลสดและผ่อน คลายไปกับเครื่องดื่มในช่วงเย็น</p>\n<ul>\n<li>\n<p>ห้องอาหารเเละบาร์ป๊อบ อัพ 11.00 - 24.00 น.</p>\n</li>\n<li>\n<p>ห้องอาหาร บูกิตตา 07.00 - 24.00 น.</p>\n</li>\n<li>\n<p>ล็อบบี้ เลาจน์ 10.30 - 24.00 น.</p>\n</li>\n<li>\n<p>บริการเสริฟ์อาหารเครื่องดื่มถึงห้อง 06.00 - 24.00 น.</p>\n</li>\n</ul>', '', '', '2013-02-07 15:09:52', NULL, '2013-02-14 15:15:24', NULL),
(49, 22, 'th', 'โรงแรมอ่าวนาง พาราไดซ์ รีสอร์ท', 'โรงแรมอ่าวนาง-พาราไดซ์-รีสอร์ท', '  อ่าวนาง พาราไดซ์ รีสอร์ทสัมผัสบรรยากาศร่มรื่นริมทะเล!อ่าวนาง จ.กระบี่ปลดปล่อยทุกจินตนาการแห่งการพักผ่อนที่อ่าวพนางพาราไดส์ รีสอร์ท จ.กระ', '<p style="padding-left: 30px;"><span style="color: #000000;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style="font-size: x-large;"><strong>อ่าวนาง พาราไดซ์ รีสอร์ท&nbsp;</strong></span>สัมผัสบรรยากาศร่มรื่นริมทะเล!อ่าวนาง&nbsp;<a class="lwhite14_" title="กิจกรรมท่องเที่ยวในกระบี่" href="http://www.aonang-paradise-resort.com/th/locations/nearby-attractions-activities.php"><span style="color: #000000;">จ.กระบี่</span></a>ปลดปล่อยทุกจินตนาการแห่งการพักผ่อนที่อ่าวพนางพาราไดส์ รีสอร์ท จ.กระบี่&nbsp;</span><span style="color: #000000;">อ่าวนางพาราไดซ์รีสอร์ท เป็น<a class="lwhite14_" title="โรงแรม กระบี่" href="http://www.aonang-paradise-resort.com/th/special-offers.php"><span style="color: #000000;">โรงแรมในกระบี่</span></a>ที่ตั้งอยู่บริเวณอ่าวนาง อยู่ห่างจากชายหาดอ่าวนางเพียง400เมตร หรือใช้เวลาเดินเท้าเพียง5นาทีเท่านั้น อ่าวนางพาราไดซ์รีสอร์ทเป็นหนึ่งในโรงแรมอ่าวนางที่พร้อมให้บริการท่านด้วย<span style="color: #000000;"><a class="lwhite14_" title="โปรโมชั่น ห้องพัก" href="http://www.aonang-paradise-resort.com/th/rooms.php">ห้องพัก</a></span></span>สไตล์ทรอปปิคอลผสมผสานความร่วมสมัย เป็นที่พักอ่าวนางซึ่งออกแบบไว้อย่างลงตัวท่ามกลางธรรมชาติและต้นไม้นานาพันธ์นางพาราไดส์รีสอร์ท&nbsp;เป็นอีกทางเลือกหนึ่งของโรงแรมในกระบี่ที่วิเศษสุดสำหรับการพักผ่อนในช่วงวันหยุดของคุณและครอบครัว&nbsp;และเป็นหนึ่งในโรงแรมอ่าวนางที่มีความเป็นธรรมชาติอย่างสวยงามที่สุด อีกทั้งยังมี<a class="lwhite14_" title="โปรโมชั่นสุดฮอต" href="http://www.aonang-paradise-resort.com/th/special-offers.php"><span style="color: #000000;">โปรโมชั่นสุดฮอต</span></a>รอคุณอยู่&nbsp;พบกับโปรโมชั่นดีๆสำหรับคุณได้ที่นี่เท่านั้น&nbsp;นึกถึงที่พักอ่าวนาง นึกถึงเรา&nbsp;อ่าวนางพาราไดซ์รีสอร์ท</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p style="text-align: center;"><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wi-Fi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>สระว่ายน้ำ(สำหรับเด็ก)</p>\n</li>\n<li>\n<p>ฟรี wifi</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n<li>\n<p>บาร์ริมสระน้ำ</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>ศูนย์ธุรกิจ</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>บริการรถรับ-ส่งถึงสนามบิน</p>\n</li>\n<li>\n<p>ร้านค้า</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n<li>\n<p>ห้องฟิสเนต</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-15 10:18:21', NULL, '2013-02-18 15:09:26', NULL),
(35, 6, 'en', 'Lub Sbuy Guest House', 'lub-sbuy-guest-house', '', '<p><span>&nbsp; &nbsp; &nbsp; &nbsp; The newly opened Guest house is designed by one of the most regarded Guest house designers in phuket it offers 19 room Place is the perfect guest house for you. We are located in the center of the city. lt is as convenient as you can explore the Phuket. The rooms of our guest house are newly built and very clean There are Standard Air-Condition, Standard Fan and Dorm fan room. And you can choose Mix Dorm (Male-Female) room and Female Dorm (Only Female) room. We do also provide you all the facilities as hot water shower with private bathroom our shared bathroom .</span></p>', '<p><strong>Accommodation&nbsp;</strong>&nbsp;</p>\n<p><strong>Air Condition Facilities</strong></p>\n<ul type="disc">\n<ul>\n<li>\n<p>Refrigerator</p>\n</li>\n<li>\n<p>Cable TV.</p>\n</li>\n<li>\n<p>Hot-Cold Shower</p>\n</li>\n<li>\n<p>In House Phone</p>\n</li>\n<li>\n<p>Safety Box</p>\n</li>\n</ul>\n</ul>\n<p><strong>Standand Fan Facilities</strong>&nbsp;with Shared Bathroom&nbsp;</p>\n<p align="left"><strong>Our Facilities &amp; Services</strong></p>\n<p align="left">&nbsp;</p>\n<ul type="disc">\n<li>Internet Service at Lobby</li>\n<li>Laundry Service</li>\n<li>Taxi Service</li>\n<li>Rental Car Service</li>\n<li>Tour Service</li>\n<li>Lub Sbuy Bar</li>\n</ul>', '', '', '2013-02-12 16:35:17', NULL, '2013-02-19 10:15:18', NULL),
(48, 22, 'en', 'AONANG PARADISE RESORT&LONGSTAY', 'aonang-paradise-resort-amp-longstay', 'Aonang paradise resort - Krabi Hotel Thailand is located a mere 400 metres from Aonang beach which can be easily reached with a 5 minute walk.', '<p style="padding-left: 30px;"><strong><span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style="font-size: x-large;">&nbsp;Aonang paradise resort</span></span></strong><span class="apple-converted-space"><span>&nbsp;</span></span><span>- Krabi Hotel Thailand is located a mere 400 metres from Aonang beach which can be easily reached with a 5 minute walk</span><span lang="TH">ใ</span><span>Aonang Paradise Resort-Krabi stands out from other Aonang hotels due to it''s stylish combination of tropical lifestyle and contemporary design set amidst striking natural surroundings.&nbsp;A slice of tranquility, paradise offers privacy and intimacy under the shade of a wide variety of indigenous trees and shrubs which we have cultivated over the past decade.&nbsp;With over 10 years of experience in the Krabi hotels industry we strive to provide a uniquely friendly and informal service which we hope will put you at ease and make your stay at Aonang paradise a memorable one.&nbsp;This sophisticated provincial Krabi resort is an ideal location to spend a peaceful holiday.Our management''s no.1 commitment is to ensure service of the highest standards amongst Aonang hotels.&nbsp;Aonang Paradise Resort&hellip;&hellip;the one of the best destination of Krabi hotels.An ideal location to spend a peaceful holiday and relax, enjoyable for the whole family</span></p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p style="text-align: center;"><span style="font-size: xx-large;">Facilities&amp;Services</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>airport transfer</li>\n<li>business center</li>\n<li>coffee shop</li>\n<li>laundry service/dry cleaning</li>\n<li>poolside bar</li>\n<li>restaurant</li>\n<li>room srvice</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>shop</li>\n<li>tours</li>\n<li>safety deposit boxes</li>\n<li>Wi-Fi in public areas</li>\n<li>fitness center</li>\n<li>massage</li>\n<li>outdoor pool</li>\n<li>pool(kids)</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-15 09:55:35', NULL, '2013-02-15 10:29:18', NULL),
(12, 2, 'en', 'Bhukitta Hotel & Spa', 'bhukitta-hotel-amp-spa', 'Bhukitta Hotel & spa is located in the heart of Phuket City which is easy to access “Old Town” and many attractions area', '<p><span>Bhukitta Hotel &amp; spa is located in the heart of Phuket City which is easy to access &ldquo;</span><strong>Old Town</strong>&rdquo; and many attractions area. The design of the Hotel combines an elegant blend of contemporary design with a modern Thai touch, all the latest amenities and free internet Wi-Fi, so ensuring a relaxing stay for all quests. Surest that everyday of your stay, indulge yourself with finest cuisine and exotic aromatherapy spa. Memorable getaways are guaranteed.</p>', '<table border="0">\n<tbody>\n<tr>\n<td style="text-align: center;" colspan="2">\n<p><strong><span style="font-size: x-large;">Facilities</span></strong></p>\n</td>\n</tr>\n<tr>\n<td style="width: 300px;">\n<p><strong>Service &amp; Facilities Information:</strong></p>\n<ul>\n<li>\n<p>24 Hour Reception</p>\n</li>\n<li>\n<p>24 Hour Security</p>\n</li>\n<li>\n<p>Airport Transfer</p>\n</li>\n<li>\n<p>Concierge Counter</p>\n</li>\n<li>\n<p>Bhukitta Spa and Sauna room</p>\n</li>\n<li>\n<p>Parking Area</p>\n</li>\n<li>\n<p>Complimentary Newpaper (Lobby Lounge)</p>\n</li>\n<li>\n<p>Currency Exchange</p>\n</li>\n<li>\n<p>Free Internet Wi-Fi</p>\n</li>\n<li>\n<p>Laundry &amp; Dry Service</p>\n</li>\n<li>\n<p>Room Service (06.00 am. - 12.00 pm.)</p>\n</li>\n<li>\n<p>Tours &amp; Transport Desk</p>\n</li>\n<li>\n<p>Meeting Room</p>\n</li>\n<li>\n<p>Swimming Pool</p>\n</li>\n</ul>\n</td>\n<td>\n<p><strong>Restaurants &amp; Bar:</strong></p>\n<p>Food lover can fully enjoy an extensive range of local dishes in a wide variety of regional styles: Thai &amp; international food, Barbecue Seafood Dinner. Discover a wonderful place to sit and enjoy to fresh seafood and relaxing drinks in the evening.</p>\n<ul>\n<li>\n<p>Pop Up Restaurant &amp; Bar 5.00 p.m. - 01.00 a.m.</p>\n</li>\n<li>\n<p>Bhukitta Restaurant 07.00 a.m. - 11.00 p.m.</p>\n</li>\n<li>\n<p>Lobby Lounge 10.30 a.m. - 11.00 p.m.</p>\n</li>\n<li>\n<p>Room Service 06.00 a.m. - 12.00 p.m</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p><strong>&nbsp;</strong></p>', '', '', '2013-02-08 11:01:11', NULL, '2013-02-12 16:46:08', NULL),
(47, 21, 'en', 'Kata Lucky Villa & Pool Access ', 'kata-lucky-villa-amp-pool-access', 'a mere 500 meters from Kata Beach and is surrounded by mountains and beautiful gardens.', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong><span style="font-size: x-large;">Welcome to Kata Lucky Villa</span></strong> located in central Kata, a mere 500 meters&nbsp;from Kata Beach and is surrounded by mountains and beautiful gardens. If you have been searching for a place to relax- you can now end your search! We create a relaxing atmosphere in a tropical garden villa style for you and your family to enjoy. We are one of the best choices and will make you feel at home whilst you enjoy the warm, friendly and comfortable environment.</p>', '<table border="1">\n<tbody>\n<tr>\n<td style="background-color: #ffffcc;" colspan="2">\n<p><strong><span style="font-size: xx-large;">Villa Facilities:</span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>24 hours reception service</p>\n</li>\n<li>\n<p>Airport transfers</p>\n</li>\n<li>\n<p>Facsimile</p>\n</li>\n<li>\n<p>Laundry</p>\n</li>\n<li>\n<p>Car Parking</p>\n</li>\n<li>\n<p>Swimming pool &amp; Pool bar</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>Restaurant</p>\n</li>\n<li>\n<p>Safe deposit box</p>\n</li>\n<li>\n<p>Security Service (24 hours)</p>\n</li>\n<li>\n<p>Tour Information</p>\n</li>\n<li>\n<p>Car &amp; Motobike Rental</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-14 15:36:56', NULL, '2013-02-14 17:04:19', NULL),
(36, 16, 'en', 'Krabi Resort', 'krabi-resort', 'The Krabi Resort is situated within a quick walk to the city centre and offers free Wi-Fi, a kids pool and an outdoor pool. It has exclusive access to a secluded beach. ', '<p style="padding-left: 30px;"><span><span style="font-size: x-large;">&nbsp; &nbsp;&nbsp;<strong>The Krabi Resort</strong></span> is situated within a quick walk to the city centre and offers free Wi-Fi, a kids pool and an outdoor pool. It has exclusive access to a secluded beach.&nbsp;</span><span>This relaxed and modern resort has 170 rooms and features a contemporary interior. With tennis courts, it also offers a 24 hour reception, a lift and conference room(s).&nbsp;</span>The resort''s express check-in/check-out feature ensures a fast and easy arrival and departure experience.&nbsp;All rooms at the Krabi Resort have king-size bedding and a private bathroom with a shower, a hair dryer and complimentary toiletries. A TV, a safe and cable / satellite channels can be found in each room of the resort. As standard, all rooms are air conditioned and also have tea and coffee making facilities and a mini bar.</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><strong><span style="font-size: xx-large;">Facilities&amp;Services</span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>bar/pub</p>\n</li>\n<li>\n<p>family room</p>\n</li>\n<li>\n<p>restaurant</p>\n</li>\n<li>\n<p>massage</p>\n</li>\n<li>\n<p>private beach</p>\n</li>\n<li>\n<p>WiFi access (charged)</p>\n</li>\n<li>\n<p>car park</p>\n</li>\n<li>\n<p>airport transfer</p>\n</li>\n<li>\n<p>coffee shop</p>\n</li>\n<li>\n<p>laundry service/dry cleaning</p>\n</li>\n<li>\n<p>room service&nbsp;</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>shops</p>\n</li>\n<li>\n<p>tours</p>\n</li>\n<li>\n<p>outdoor pool</p>\n</li>\n<li>\n<p>water sports (non-motorized)</p>\n</li>\n<li>\n<p>meeting facilities</p>\n</li>\n<li>\n<p>poolside bar</p>\n</li>\n<li>\n<p>safety deposit boxes</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n<li>\n<p>garden</p>\n</li>\n<li>\n<p>pool(kids)</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-13 09:24:56', NULL, '2013-02-15 11:11:28', NULL),
(37, 16, 'th', 'โรงแรมกระบี่รีสอร์ท', 'โรงแรมกระบี่รีสอร์ท', 'กระบี่รีสอร์ท  ตั้งอยู่บนหาดอ่าวนาง รีสอร์ทมีทางเชื่อมไปยังชายหาดโดยตรง และให้บริการห้องพักสวยงามพร้อมลานระเบียงส่วนตัว รีสอร์ทมีสระว่ายน้ำกลางแจ้งขนาดใหญ่ และห้องอาหารพร้อมวิวทะเลที่สวยงาม', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style="font-size: x-large;"><strong>กระบี่รีสอร์ท</strong> </span>&nbsp;ตั้งอยู่บนหาดอ่าวนาง รีสอร์ทมีทางเชื่อมไปยังชายหาดโดยตรง และให้บริการห้องพักสวยงามพร้อมลานระเบียงส่วนตัว รีสอร์ทมีสระว่ายน้ำกลางแจ้งขนาดใหญ่ และห้องอาหารพร้อมวิวทะเลที่สวยงาม&nbsp;รีสอร์ทตั้งอยู่ใกล้แหล่งดำน้ำที่กระบี่ที่งดงามและหน้าผาหินปูน และห่างจากถ้ำพระนางเพียง 4 กม. ท่านสามารถเดินทางโดยรถยนต์ 30 นาทีจากรีสอร์ทไปยังสนามบินนานาชาติกระบี่&nbsp;ห้องพักตกแต่งแบบไทยดั้งเดิมหรือร่วมสมัยด้วยเฟอร์นิเจอร์อย่างดี ห้องพักแต่ละห้องมีเคเบิลทีวี มินิบาร์ และพื้นที่นั่งพักผ่อนกว้างขวาง ห้องพักส่วนใหญ่มีอ่างอาบน้ำหรูหรา&nbsp;นอกจากนี้ยังมีกิจกรรมสันทนาการ เช่น การปีนเขา ดำน้ำลึก และดำน้ำตื้น รีสอร์ทยังให้บริการจัดทัวร์ บริการรับส่งสนามบิน และอินเทอร์เน็ตไร้สาย โดยมีค่าธรรมเนียม&nbsp;The Boat ให้บริการอาหารไทยและอาหารนานาชาติตลอดทั้งวัน นอกจากนี้ยังมีบาร์บีคิวอาหารทะเลสดให้บริการ ท่านสามารถเพลิดเพลินกับเครื่องดื่มสดชื่นได้ที่ Beach and Pool Bar</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wi-Fi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>บาร์/ผับ</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>ห้องประชุม</p>\n</li>\n<li>\n<p>กีฬาทางน้ำ</p>\n</li>\n<li>\n<p>ชายหาดส่วนตัว</p>\n</li>\n<li>\n<p>สระว่ายน้ำ(สำหรับเด็ก)</p>\n</li>\n<li>\n<p>สวน</p>\n</li>\n<li>\n<p>WiFi (เสียค่าใช้จ่าย)</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>บาร์ริมสระน้ำ</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>บริการรถรับ-ส่งถึงสนามบิน</p>\n</li>\n<li>\n<p>ร้านค้า</p>\n</li>\n<li>\n<p>ห้องแฟมิลี่รูม</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', '', '2013-02-13 09:27:24', NULL, '2013-02-18 11:29:25', NULL),
(13, 3, 'th', 'โรงแรมซีโคโน่ ป่าตองภูเก็ต', 'โรงแรมซีโคโน่-ป่าตองภูเก็ต', 'Sea Cono Hotel ตั้งอยู่ห่างจากหาดป่าตองโดยใช้เวลาเดินเพียง 15 นาที ให้บริการที่พักสไตล์บูติกหรูหราพร้อมระเบียงส่วนตัว', '<p style="padding-left: 60px;"><strong><span style="font-size: x-large;">&nbsp; &nbsp; โรงแรมซีโคโน่</span></strong>&nbsp;ตั้งอยู่ห่างจากหาดป่าตองโดยใช้เวลาเดินเพียง 15 นาที ให้บริการที่พักสไตล์บูติกหรูหราพร้อมระเบียงส่วนตัว มีสระว่ายน้ำกลางแจ้งซึ่งรายล้อมด้วยเก้าอี้อาบแดด ห้องอาหารทะเล และบริการฟรีอินเทอร์เน็ตไร้สาย (Wi-Fi) ทั่วบริเวณโรงแรม โรงแรมตั้งอยู่ในทำเลสะดวก ห่างจากศูนย์การค้าจังซีลอนและตลาดบ้านซ้าน (ตลาดโต้รุ่ง)โดยใช้เวลาเดิน 5 นาที ซอยบางลาอันมีชีวิตชีวายังอยู่ห่างจาก Sea Cono Boutique Hotel โดยใช้เวลาเดินเพียง 10 นาที ขณะที่สนามบินภูเก็ตอยู่ห่างออกไป 45 นาทีหากเดินทางโดยรถยนต์ห้องพักปรับอากาศตกแต่งอย่างหรูหรา มีโทรทัศน์จอแบนระบบช่องสัญญาณเคเบิลขนาดใหญ่ ตู้นิรภัยภายในห้องพัก และมินิบาร์ ทุกห้องมีห้องน้ำในตัวพร้อมเครื่องใช้ในห้องน้ำ</p>\n<p style="padding-left: 30px;">&nbsp;</p>', '<table border="0">\n<tbody>\n<tr>\n<td colspan="2"><span style="font-size: xx-large;"><strong>สิ่งอำนวยความสะดวก</strong></span></td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wifi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>ลิฟท์</p>\n</li>\n<li>\n<p>พื้นที่สูบบุหรี่</p>\n</li>\n<li>\n<p>บาร์ริมสระ</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>ศูย์ธุรกิจ</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n<li>\n<p>บริการซักรีดฝซักแห้ง</p>\n</li>\n<li>\n<p>พนักงานต้อนรับ</p>\n</li>\n<li>\n<p>ห้องแฟมิลี่รูม</p>\n</li>\n<li>\n<p>สรว่ายน้ำกลางจ้ง</p>\n</li>\n<li>\n<p>ฟรี LAN และ Wifi</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-08 14:16:30', NULL, '2013-02-14 14:23:52', NULL);
INSERT INTO `ci_hotel_translate` (`hott_id`, `hott_hotel_id`, `hott_lang`, `hott_name`, `hott_url`, `hott_short_description`, `hott_description`, `hott_detail`, `hott_included`, `hott_remark`, `hott_cr_date`, `hott_cr_uid`, `hott_lu_date`, `hott_lu_uid`) VALUES
(14, 3, 'en', 'Sea Cono Hotel', 'sea-cono-hotel', 'Just a 15-minute walk from Patong Beach, Sea Cono Hotel offers elegant, boutique accommodation with private balconies. It boasts an outdoor pool surrounded by sun loungers,', '<p>Just a 15-minute walk from Patong Beach, Sea Cono Hotel offers elegant, boutique accommodation with private balconies. It boasts an outdoor pool surrounded by sun loungers, a seafood restaurant, and free Wi-Fi in the entire hotel.</p>\n<p>The hotel is conveniently located, a 5-minute walk from Jungceylon Shopping Mall and Baan San (night market). The vibrant Bangla Road is also just a 10-minute walk from Sea Cono Boutique Hotel, while Phuket Airport is a 45-minute drive away.</p>\n<p>The air-conditioned rooms are elegantly decorated and feature a large flat-screen cable TV, an in-room safe and a minibar. They all have an en suite bathroom fitted with toiletries.</p>\n<p>Sea Cono Seafood Restaurant serves both Thai and Chinese specialities. It also has an international menu. Guests can also sample local dishes at the nearby eateries.</p>\n<p>Laundry, ironing and shuttle services are provided for guests&rsquo; convenience. Free public parking is available at a location nearby</p>', '<table border="0">\n<tbody>\n<tr>\n<td><strong style="font-size: x-large;">Superior Room DBL:</strong></td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<p><img title="Sea Cono Hotel Phuket - Superior room " src="http://cdn4.agoda.net/hotelimages/291/291321/291321_111220175917320_STD.jpg" alt="Sea Cono Hotel Phuket - Superior room " /></p>\n</td>\n<td>\n<p style="padding-left: 30px;">&nbsp;</p>\n<p style="padding-left: 30px;"><strong>Numbers:</strong>&nbsp;11</p>\n<p style="padding-left: 30px;"><strong>Detail:</strong> 1 bed</p>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td><strong style="font-size: x-large;">Superior Room TWN :</strong></td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td><img title="Sea Cono Hotel Phuket - Superior room " src="http://cdn1.agoda.net/hotelimages/291/291321/291321_111220175918742_STD.jpg" alt="Sea Cono Hotel Phuket - Superior room " /></td>\n<td>\n<p style="padding-left: 30px;"><strong>Numbers:</strong>&nbsp;20&nbsp;</p>\n<p style="padding-left: 30px;"><strong>Detail:</strong>&nbsp;2 bed</p>\n</td>\n</tr>\n<tr>\n<td><strong style="font-size: x-large;">Family Rom :</strong></td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>&nbsp;<img title="Sea Cono Hotel Phuket - Deluxe room" src="http://cdn3.agoda.net/hotelimages/291/291321/291321_111220175936164_STD.jpg" alt="Sea Cono Hotel Phuket - Deluxe room" /></td>\n<td>\n<p style="padding-left: 30px;"><strong>Numberd:</strong>&nbsp;2</p>\n<p style="padding-left: 30px;"><strong>Detail:&nbsp;</strong>2 Adults, &nbsp;2 childrens</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p><strong>Facibilities</strong></p>\n<table border="0">\n<tbody>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wifi in&nbsp;Pubblic area</p>\n</li>\n<li>\n<p>Safety Deposit Box</p>\n</li>\n<li>\n<p>Restaurant</p>\n</li>\n<li>\n<p>concierge</p>\n</li>\n<li>\n<p>Smoking area</p>\n</li>\n<li>\n<p>Poolside bar</p>\n</li>\n<li>\n<p>Room Servic</p>\n</li>\n<li>\n<p>Elevator</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>Coffee Shop</p>\n</li>\n<li>\n<p>Tours</p>\n</li>\n<li>\n<p>Laundry Service/Dry Cleaning</p>\n</li>\n<li>\n<p>Business Center</p>\n</li>\n<li>\n<p>Family Room</p>\n</li>\n<li>\n<p>Outdoor Pool</p>\n</li>\n<li>\n<p>Free LAN and Wifi access</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p><span style="color: #000000;">*ราคาค่าห้องพักจะเปลี่ยนไปตามฤดูกาลท่องเที่ยว หากต้องการจองห้องพักหลังจากวันที่ 20 เม.ย 2555 กรุณาติดต่อเราเพื่อสอบถามราคาได้ตามเบอร์โทรบนเว็บไซต์</span></p>', '', '', '2013-02-08 16:13:22', NULL, '2013-02-08 16:16:27', NULL),
(15, 4, 'th', 'โรงแรมกะรนพริ้นเซส ภูเก็ต', 'โรงแรมกะรนพริ้นเซส-ภูเก็ต', 'โรงแรมกะรนพริ้นเซสใจกลางหาดกะรนภูเก็ตท่ามกลางธรรมชาติของท้องทะเลอันดามันและทิวเขาอันเขียวชอุ่ม', '<p style="padding-left: 30px;"><span><span style="font-size: x-large; color: #ff9900;"><span style="font-size: xx-large;">&nbsp; &nbsp; โรงแรมกะรนพริ้นเซสใจกลางหาดกะรน</span>ภูเก็ตท่ามกลางธรรมชาติของท้องทะเลอันดามัน</span>และทิวเขาอันเขียวชอุ่มไล่ระดับสูงต่ำลดหลั่นกันไป ใช้</span><span>เวลาเดินทางเพียง 45 นาทีจากสนามบินนานาชาติภูเก็ต 10 นาทีจากหาดป่าตองอันลือชื่อ และ 20 นาที จากตัวเมืองภูเก็ต โรงแรมกะรนพริ้นเซส&nbsp;<span>ต้อนรับคุณด้วยบรรยากาศแสนอบอุ่นจากพนักงานคนไทยของเราที่พร้อมจะให้บริการ และสรรหาสิ่งที่ดีสำหรับคุณ การออกแบบของโรงแรมกะรนพริ้นเซส เน้นการตอบสนองความต้องการในวันหยุดพักผ่อนอันแสนพิเศษ ด้วยความรื่นรมย์และความสงบของธรรมชาติไปพร้อมกับความหรูหราสะดวกสบาย ให้รู้สึกเหมือนพักผ่อนที่บ้านของคุณเอง</span></span></p>', '<table border="0">\n<tbody>\n<tr>\n<td><span style="font-size: x-large;"><strong>สิ่งอำนวยความสะดวกภายในห้องพัก</strong></span></td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>&nbsp;เครื่องชงกาแฟ / ชา</li>\n<li>\n<p>เครื่องเป่าผม</p>\n</li>\n<li>\n<p>เซฟ</p>\n</li>\n<li>\n<p>ตู้เย็นพร้อมมินิบาร์</p>\n</li>\n<li>\n<p>โทรศัพท์</p>\n</li>\n<li>\n<p>ทีวีผ่านดาวเทียม</p>\n</li>\n<li>\n<p>ปรับอากาศ</p>\n</li>\n<li>\n<p>ห้องน้ำที่มีอ่างอาบน้ำและฝักบัว&nbsp;</p>\n</li>\n<li>\n<p>อุปกรณ์อาบน้ำห้องน้ำเต็มชุด</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-08 17:01:48', NULL, '2013-02-14 14:14:06', NULL),
(18, 7, 'en', 'Hyton Leelavadee Hotel', 'hyton-leelavadee-hotel', 'Hyton Leelavadee Resort is located only 3 minutes walking to the best location of Patong beach.', '<p class="size18" style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp;<strong><span style="font-size: x-large;">Hyton Leelavadee Resort</span> </strong>is located only 3 minutes walking to the best location of Patong beach.It is Only 150 meters away from Patong-Phuket town bus terminal, and approx 500 meters to the entertainment and shopping area of Patong.From the entertainment area on second road of Patong you''re turn right at the far end corner of road, or turn left at far end corner when you''re on beach road.</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><strong><span style="font-size: xx-large;">Facilities&amp;Services</span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>24hr room service</p>\n</li>\n<li>\n<p>family room</p>\n</li>\n<li>\n<p>restaurant</p>\n</li>\n<li>\n<p>smoking area</p>\n</li>\n<li>\n<p>fitness center</p>\n</li>\n<li>\n<p>massage</p>\n</li>\n<li>\n<p>WiFi access (charged)</p>\n</li>\n<li>\n<p>car park</p>\n</li>\n<li>\n<p>airport transfer</p>\n</li>\n<li>\n<p>coffee shop</p>\n</li>\n<li>\n<p>laundry service/dry cleaning</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>pool (kids)</p>\n</li>\n<li>\n<p>garden</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n<li>\n<p>safety deposit boxes</p>\n</li>\n<li>\n<p>poolside bar</p>\n</li>\n<li>\n<p>babysitting</p>\n</li>\n<li>\n<p>sauna</p>\n</li>\n<li>\n<p>outdoor pool</p>\n</li>\n<li>\n<p>jacuzzi</p>\n</li>\n<li>\n<p>tours</p>\n</li>\n<li>\n<p>room service</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '<p><span style="font-size: medium;">&nbsp;</span></p>\n<p>&nbsp;</p>', '', '2013-02-12 14:10:25', NULL, '2013-02-19 09:38:27', NULL),
(19, 8, 'en', 'LANTA RESORT', 'lanta-resort', 'Located on Pra-ae Beach or Long Beach, Lanta Resort is set near the beach and offers a variety of activities including diving and snorkelling. Free parking is available. ', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style="font-size: x-large;"><strong>LANTA RESORT</strong></span>&nbsp;Located on Pra-ae Beach or Long Beach, Lanta Resort is set near the beach and offers a variety of activities including diving and snorkelling. Free parking is available.&nbsp;Rooms at Lanta Resort feature a private terrace or balcony. They offer air conditioning, tea and coffee-making facilities and a hair dryer in the en-suite bathroom. Wi-Fi internet access is available at an additional charge.Lanta Resort offers an outdoor swimming pool and a tour desk. Other activities offered include canoeing, sailing and fishing.&nbsp;The Barringtonia Restaurant offers European cuisine.Lanta Resort is minutes away from Saladan, Koh Lanta''s centre for shopping, entertainment and dining. The resort offers a transfer service from Krabi International Airport.</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">Facilities&amp;Services</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>bar/pub</p>\n</li>\n<li>\n<p>restaurant</p>\n</li>\n<li>\n<p>massage</p>\n</li>\n<li>\n<p>private beach</p>\n</li>\n<li>\n<p>WiFi access (charged)</p>\n</li>\n<li>\n<p>car park</p>\n</li>\n<li>\n<p>outdoor pool</p>\n</li>\n<li>\n<p>jacuzzi</p>\n</li>\n<li>\n<p>tours</p>\n</li>\n<li>\n<p>room service</p>\n</li>\n<li>\n<p>laundry service/dry cleaning</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>coffee shop</p>\n</li>\n<li>\n<p>bicycle rental</p>\n</li>\n<li>\n<p>airport transfer</p>\n</li>\n<li>\n<p>business center</p>\n</li>\n<li>\n<p>meeting facilities</p>\n</li>\n<li>\n<p>poolside bar</p>\n</li>\n<li>\n<p>safety deposit boxes</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n<li>\n<p>garden</p>\n</li>\n<li>\n<p>pool(kids)</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>', '', '', '2013-02-12 14:18:01', NULL, '2013-02-15 10:43:26', NULL),
(20, 8, 'th', 'โรงแรมลันตารีสอร์ท', 'โรงแรมลันตารีสอร์ท', 'ลันตารีสอร์ทตั้งอยู่บนหาดพระแอหรือหาดยาว อยู่ไม่ไกลจากชายหาด และมีกิจกรรมหลากหลายให้ท่านได้เพลิดเพลิน รวมถึงการดำน้ำและดำน้ำตื้น บริการที่จอดรถฟรี', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp;<strong><span style="font-size: x-large;"> ลันตารีสอร์ท&nbsp;</span></strong>ตั้งอยู่บนหาดพระแอหรือหาดยาว อยู่ไม่ไกลจากชายหาด และมีกิจกรรมหลากหลายให้ท่านได้เพลิดเพลิน รวมถึงการดำน้ำและดำน้ำตื้น บริการที่จอดรถฟรี&nbsp;ห้องพักที่ลันตารีสอร์ทมีลานระเบียงหรือระเบียงส่วนตัว ติดตั้งเครื่องปรับอากาศ อุปกรณ์ชงชา/กาแฟ และมีห้องน้ำในตัวพร้อมเครื่องเป่าผม สำหรับการใช้อินเทอร์เน็ตไร้สาย (Wi-Fi) มีค่าใช้จ่ายเพิ่มเติมลันตารีสอร์ทมีบริการสระว่ายน้ำกลางแจ้งและโต๊ะบริการทัวร์ กิจกรรมอื่นๆ ที่เรามอบให้ท่านรวมถึงการพายเรือแคนู การแล่นเรือใบ และการตกปลา&nbsp;ร้านอาหาร Barringtonia มีบริการอาหารยุโรปลันตารีสอร์ทอยู่ไม่ไกลจากศาลาด่าน ซึ่งเป็นศูนย์กลางการช็อปปิ้ง สถานบันเทิง และร้านอาหารของเกาะลันตา รีสอร์ทเราให้บริการรถรับส่งจากสนามบินนานาชาติกระบี่</p>\n<p style="padding-left: 30px;">&nbsp;</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wi-Fi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>บาร์/ผับ</p>\n</li>\n<li>\n<p>ห้องอาหาร</p>\n</li>\n<li>\n<p>ร้านประชุม</p>\n</li>\n<li>\n<p>ชายหาดส่วนตัว</p>\n</li>\n<li>\n<p>สระว่ายน้ำ(สำหรับเด็ก)</p>\n</li>\n<li>\n<p>สวน</p>\n</li>\n<li>\n<p>WiFi (เสียค่าใช้จ่าย)</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n<li>\n<p>จักรยานให้เช่า</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>ศูนย์ธุรกิจ</p>\n</li>\n<li>\n<p>คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>บริการรถรับ-ส่งถึงสนามบิน</p>\n</li>\n<li>\n<p>จาคุซซี่</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n<li>\n<p>บาร์ริมสระน้ำ</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p><span style="font-size: medium;">&nbsp;</span></p>\n<p>&nbsp;</p>', '', '', '2013-02-12 14:21:06', NULL, '2013-02-18 10:35:06', NULL),
(16, 4, 'en', 'Karon Princess Hotel', 'karon-princess-hotel', 'Idyllically located in the heart of Karon Beach, Phuket Karon Princess Hotel turns your abstract fantasy into tangible.', '<p style="padding-left: 30px;"><strong><span style="font-size: x-large;">&nbsp; &nbsp; Karon Princess Hotel</span></strong> - At Karon Beach Phuket, Thailand Idyllically located in the heart of Karon Beach, Phuket Karon Princess Hotel turns your abstract fantasy into tangible. Only 45 minutes scenic drive from the international airport, 10 minutes to Patong Beach and 20 minutes to Phuket downtown. Karon Princess Hotel design to provide a spacious and relaxed atmosphere with a warm and friendly service. A perfect place for relaxation where you can ease your mind and enjoy the beauty of peaceful nature, offering our guests the simple elegance of a tropical paradise with all comforts of home.</p>', '<table border="1">\n<tbody>\n<tr>\n<td style="background-color: #ffffcc;">\n<p><strong><span style="font-size: xx-large;">Facilities and Services</span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Restaurant &amp; Bars</p>\n</li>\n<li>\n<p>Room Service</p>\n</li>\n<li>\n<p>Swimming Pool with Jacuzzi &amp; Kids pool</p>\n</li>\n<li>\n<p>Tour desk &amp; motorbike rental</p>\n</li>\n<li>\n<p>Internet service (chargeable)</p>\n</li>\n<li>\n<p>Currency ExchangeLaundry Service</p>\n</li>\n<li>\n<p>Doctor on Call</p>\n</li>\n<li>\n<p>24 Hour Security Guard</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', '', '2013-02-11 12:17:40', NULL, '2013-02-14 17:03:20', NULL),
(17, 6, 'th', 'โรงแรมหลับสบายเกสท์เฮ้าส์', 'โรงแรมหลับสบายเกสท์เฮ้าส์', 'หลับสบายเกสท์เฮ้าส์ตั้งอยู่ในใจกลางเมืองภูเก็ต ให้บริการห้องพักพร้อมระเบียงส่วนตัว เกสต์เฮาส์แห่งนี้มีบริการแผนกต้อนรับส่วนหน้าตลอด 24 ชั่วโมง', '<p>&nbsp; &nbsp; &nbsp;<span style="font-size: x-large;"> &nbsp;<span style="color: #ff9900;"><span style="font-size: xx-large;">หลับสบายเกสท์เฮ้าส์</span>ตั้งอยู่ในใจกลางเมืองภูเก็ต</span></span> ให้บริการห้องพักพร้อมระเบียงส่วนตัว เกสต์เฮาส์แห่งนี้มีบริการแผนกต้อนรับส่วนหน้าตลอด 24 ชั่วโมงและโต๊ะบริการทัวร์ ใช้เวลาเดินทางโดยรถยนต์เพียง 5 นาทีไปยังท่าเรือรัษฎาซึ่งให้บริการไปยังเกาะพีพี นอกจากนี้ยังมีศูนย์การค้าพร้อมโรงภาพยนตร์ตั้งอยู่ในบริเวณใกล้เคียงกับเกสต์เฮาส์</p>', '<table border="0">\n<tbody>\n<tr>\n<td colspan="2"><span style="font-size: x-large;"><strong>ที่พักและสิ่งอำนวยความสะดวก</strong>&nbsp;</span><span style="font-size: x-large;">&nbsp;</span></td>\n</tr>\n<tr>\n<td>\n<ul type="disc">\n<li>\n<p>บริการอินเทอร์เน็ตที่ล็อบบี้</p>\n</li>\n<li>\n<p>บริการซักรีด</p>\n</li>\n<li>\n<p>บริการรถแท็กซี่</p>\n</li>\n<li>\n<p>บริการรถเช่า</p>\n</li>\n<li>\n<p>บริการทัวร์</p>\n</li>\n<li>\n<p>บาร์ Lub Sbu</p>\n</li>\n<li>\n<p>LAN (เสียค่าใช้จ่าย)y</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>ศูนย์ธุรกิจ</p>\n</li>\n<li>\n<p>พนกงานต้อนรับ</p>\n</li>\n<li>\n<p>รูมเซอร์วิส 24 ชั่วโมง</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n<li>\n<p>ฟรีWfi</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-12 10:11:25', NULL, '2013-02-14 16:23:24', NULL),
(25, 7, 'th', 'โรงแรม ไฮย์ตั้นลีลาวดี', 'โรงแรม-ไฮย์ตั้นลีลาวดี', 'โรงแรม ไฮย์ตั้นลีลาวดี ตั้งอยู่ห่างจากหาดป่าตองโดยใช้เวลาเดินเพียง 3 นาที ให้บริการห้องพักปรับอากาศท่ามกลางสวนเขตร้อน', '<p style="padding-left: 60px;">&nbsp; &nbsp; &nbsp; <span style="font-size: x-large;"><strong>&nbsp; &nbsp; โรงแรม ไฮย์ตั้นลีลาวดี</strong></span>&nbsp;ตั้งอยู่ห่างจากหาดป่าตองโดยใช้เวลาเดินเพียง 3 นาที ให้บริการห้องพักปรับอากาศท่ามกลางสวนเขตร้อน โรงแรมมีสระว่ายน้ำกลางแจ้ง บริการนวดแผนไทย และแผนกต้อนรับส่วนหน้าซึ่งเปิดบริการตลอด 24 ชั่วโมงห้องพักปรับอากาศขนาดกว้างขวางแต่ละห้องมีระเบียงส่วนตัว โทรทัศน์ระบบช่องสัญญาณเคเบิล/ดาวเทียม สิ่งอำนวยความสะดวกอันทันสมัย ได้แก่ มินิบาร์ ชุดคลุมอาบน้ำ และรองเท้าแตะ&nbsp;โรงแรม ไฮย์ตั้นลีลาวดี&nbsp;อยู่ห่างจากสถานที่ท่องเที่ยวสำคัญ เช่น ศูนย์การค้าจังซีลอน ซอยบางลา และหาดไตรตรังโดยใช้เวลาเดิน 15 นาที การเดินทางโดยรถยนต์ไปยังสนามบินนานาชาติภูเก็ตใช้เวลา 30 นาทีโรงแรม ไฮย์ตั้นลีลาวดี&nbsp;มีศูนย์ออกกำลังกายพร้อมอุปกรณ์ออกกำลังแบบคาร์ดิโอ สระสปา และบริการนวดบำบัดด้วยกลิ่นหอมเพื่อความเพลิดเพลินและการผ่อนคลาย นอกจากนี้ยังมีอุปกรณ์บาร์บีคิวสำหรับการรับประทานอาหารกลางแจ้งแบบเป็นกันเอง&nbsp;ห้องอาหารในสถานที่ให้บริการอาหารเช้าแบบอเมริกันประจำวัน รวมถึงอาหารไทยท้องถิ่น</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>wi-fiในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>บริการพี่เลี้ยงเด็ก</p>\n</li>\n<li>\n<p>พื้นที่สูบบุหรี่</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>สระว่ายน้ำ(สำหรับเด็ก)</p>\n</li>\n<li>\n<p>สวน</p>\n</li>\n<li>\n<p>wi-fi(เสียค่าใช้จ่าย)</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n<li>\n<p>บารร์ริมสระน้ำ</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>บริการรถรับขส่ง ถึงสนามบิน</p>\n</li>\n<li>\n<p>ห้องฟิสเนต</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>จาคุซซี่</p>\n</li>\n<li>\n<p>ห้องแฟมิลี่รูม</p>\n</li>\n<li>\n<p>รูมเซอร์วิส24ชั่วโมง</p>\n</li>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>จุดบริการรถทัวร์คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>ซาวน่า</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', '', '2013-02-12 15:46:18', NULL, '2013-02-18 09:17:26', NULL),
(26, 11, 'en', 'Khaolak Seaview Resort & Spa', 'khaolak-seaview-resort-amp-spa', 'Khaolak Seaview Resort & Spa is located near Tai Muang Beach and Tublamu Navy Golf Course, overlooking the Andaman Sea.', '<p style="padding-left: 30px;"><strong><span style="font-size: x-large;">&nbsp; &nbsp; &nbsp;Khaolak Seaview Resort &amp; Spa</span></strong> is located near Tai Muang Beach and Tublamu Navy Golf Course, overlooking the Andaman Sea. The resort offers an outdoor pool and beachfront dining. The air-conditioned guestrooms at Seaview Resort Khaolak are equipped with a satellite TV, a minibar and personal safe. Handicap accessible rooms are available.&nbsp;The resort features a hot tub, squash courts and a fitness centre. Massage services and beauty treatments are available at the hotel&rsquo;s spa. The resort&rsquo;s on-site restaurant serves fresh barbecue, Thai and international cuisines. Guests can choose to dine by the pool or sea.&nbsp;Khaolak Seaview Resort &amp; Spa is a 1-hour drive from Phuket International Airport.</p>\n<p style="padding-left: 30px;">&nbsp;</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p style="text-align: center;"><span style="font-size: xx-large;">Facilities&amp;Services</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>bar/pub</p>\n</li>\n<li>\n<p>disabled facilities</p>\n</li>\n<li>\n<p>family room</p>\n</li>\n<li>\n<p>restaurant</p>\n</li>\n<li>\n<p>salon</p>\n</li>\n<li>\n<p>fitness center</p>\n</li>\n<li>\n<p>massage</p>\n</li>\n<li>\n<p>squash courts</p>\n</li>\n<li>\n<p>LAN and WiFi access (charged)</p>\n</li>\n<li>\n<p>car park</p>\n</li>\n<li>\n<p>airport transfer</p>\n</li>\n<li>\n<p>coffee shop</p>\n</li>\n<li>\n<p>laundry service/dry cleaning</p>\n</li>\n<li>\n<p>room service</p>\n</li>\n<li>\n<p>shops</p>\n</li>\n<li>\n<p>tours</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>jacuzzi</p>\n</li>\n<li>\n<p>outdoor pool</p>\n</li>\n<li>\n<p>steamroom</p>\n</li>\n<li>\n<p>valet parking</p>\n</li>\n<li>\n<p>babysitting</p>\n</li>\n<li>\n<p>business center</p>\n</li>\n<li>\n<p>concierge</p>\n</li>\n<li>\n<p>meeting facilities</p>\n</li>\n<li>\n<p>poolside bar</p>\n</li>\n<li>\n<p>safety deposit boxes</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n<li>\n<p>garden</p>\n</li>\n<li>\n<p>kids club</p>\n</li>\n<li>\n<p>pool(kids)</p>\n</li>\n<li>\n<p>spa</p>\n</li>\n<li>\n<p>tennis courrts</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-12 15:58:32', NULL, '2013-02-19 11:09:54', NULL),
(27, 11, 'th', 'โรงแรมเขาหลักซีวิวรีสอร์ทแอนด์สปา', 'โรงแรมเขาหลักซีวิวรีสอร์ทแอนด์สปา', 'เขาหลักซีวิวรีสอร์ทแอนด์สปาตั้งอยู่ใกล้กับสนามกอล์ฟหาดไทยเมืองและสนามกอล์ฟราชนาวีทับละมุ สามารถมองเห็นทิวทัศน์ที่งดงามของทะเลอันดามัน รีสอร์ทมีบริการสระว่ายน้ำกลางแจ้ง และร้านอาหารริมชายหาด', '<p style="padding-left: 30px;"><strong><span style="font-size: x-large;">&nbsp; &nbsp; &nbsp; เขาหลักซีวิวรีสอร์ทแอนด์สปา&nbsp;</span></strong>ตั้งอยู่ใกล้กับสนามกอล์ฟหาดไทยเมืองและสนามกอล์ฟราชนาวีทับละมุ สามารถมองเห็นทิวทัศน์ที่งดงามของทะเลอันดามัน รีสอร์ทมีบริการสระว่ายน้ำกลางแจ้ง และร้านอาหารริมชายหาดห้องปรับอากาศซีวิวรีสอร์ทเขาหลักที่ติดตั้งโทรทัศน์ระบบสัญญาณดาวเทียม มินิบาร์ และตูเซฟส่วนบุคคล รวมทั้งมีห้องพักสำหรับผู้พิการด้วย รีสอร์ทมีบริการอ่างจากุซซี่ สนามสควอช และฟิตเนสเซ็นเตอร์ สำหรับบริการนวดและทรีทเมนต์ความงาม เรามีบริการที่สปาของโรงแรม&nbsp;ร้านอาหารในบริเวณรีสอร์ทให้บริการบาร์บีคิวสดใหม่ รวมทั้งอาหารไทย และอาหารนานาชาติ นอกจากนี้ ท่านยังสามารถเลือกรับประทานอาหารริมสระน้ำหรือริมทะเลได้อีกด้วย&nbsp;เขาหลักซีวิวรีสอร์ทแอนด์สปาอยู่ห่างเพียง 1 ชั่วโมงจากสนามบินนานาชาติภูเก็ต โดยรถยนต์</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wi-Fi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>บริการพี่เลี้ยงเด็ก</p>\n</li>\n<li>\n<p>บาร์/ผับ</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>ห้องประชุม</p>\n</li>\n<li>\n<p>สโมสรสำหรับเด็ก</p>\n</li>\n<li>\n<p>สระว่ายน้ำ (สำหรับเด็ก)</p>\n</li>\n<li>\n<p>สวน</p>\n</li>\n<li>\n<p>ห้องอบไอน้ำ</p>\n</li>\n<li>\n<p>LAN และ WiFi (เสียค่าใช้จ่าย)</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n<li>\n<p>บาร์ริมสระน้ำ</p>\n</li>\n<li>\n<p>ร้านเสริมสวย</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>ศูนย์ธุรกิจ</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>สนามเทนนิส</p>\n</li>\n<li>\n<p>สนามสควอช</p>\n</li>\n<li>\n<p>บริการนำรถไปจอด</p>\n</li>\n<li>\n<p>คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>บริการรถรับ-ส่งถึงสนามบิน</p>\n</li>\n<li>\n<p>พนักงานต้อนรับ</p>\n</li>\n<li>\n<p>ร้านค้า</p>\n</li>\n<li>\n<p>ห้องแฟมิลี่รูม</p>\n</li>\n<li>\n<p>อำนวยความสะดวกคนพิการ</p>\n</li>\n<li>\n<p>จาคุซซี</p>\n</li>\n<li>\n<p>บริกาารนวด</p>\n</li>\n<li>\n<p>สปา</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n<li>\n<p>ห้องฟิตเนส</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-12 16:01:36', NULL, '2013-02-18 09:25:23', NULL),
(28, 12, 'en', 'Timber House Aonang', 'timber-house-aonang', 'Located on Aonang Beach, Timber House Aonang offers spacious rooms with private balconies and views of the outdoor pool or tropical garden. It features a restaurant, a spa bath and free parking.', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style="font-size: x-large;"><strong>Timber House Aonang</strong></span>&nbsp;Located on Aonang Beach, Timber House Aonang offers spacious rooms with private balconies and views of the outdoor pool or tropical garden. It features a restaurant, a spa bath and free parking.Situated within landscaped gardens, air-conditioned rooms at Timber House feature wood furnishings and cable TV.A safe and free tea/coffee making amenities are provided for guests&rsquo; convenience. Private bathrooms have toiletries and a hairdryer.Relaxing beauty treatments and facials await guests at C Spa. Leisure activities like fishing and diving trips can be arranged at the tour desk. Guests can lounge by the landscaped outdoor pool.&nbsp;Featuring views of the garden, Fish Restaurant serves grilled seafood dishes and buffet spreads with Thai and European dishes. Meals can be enjoyed in rooms.Timber House Aonang is within walking distance of the night market and several entertainment options. It is a 30-minute drive from Krabi International Airport.</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">Facilities&amp;Services</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>bar/pub</p>\n</li>\n<li>\n<p>disabled facilities</p>\n</li>\n<li>\n<p>restaurant</p>\n</li>\n<li>\n<p>massage</p>\n</li>\n<li>\n<p>LAN access</p>\n</li>\n<li>\n<p>car park</p>\n</li>\n<li>\n<p>airport transfer</p>\n</li>\n<li>\n<p>laundry service/dry cleaning</p>\n</li>\n<li>\n<p>room service</p>\n</li>\n<li>\n<p>tours</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>jacuzzi</p>\n</li>\n<li>\n<p>outdoor pool</p>\n</li>\n<li>\n<p>suana</p>\n</li>\n<li>\n<p>steamroom</p>\n</li>\n<li>\n<p>WiFi access (charged)</p>\n</li>\n<li>\n<p>concierge</p>\n</li>\n<li>\n<p>safety deposit boxes</p>\n</li>\n<li>\n<p>pool (kids)</p>\n</li>\n<li>\n<p>spa</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>', '', '', '2013-02-12 16:06:26', NULL, '2013-02-15 10:54:40', NULL),
(39, 17, 'en', 'Woraburi Phuket Resort & Spa', 'woraburi-phuket-resort-amp-spa', '', '<p><span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Woraburi Hotels and Resort, we make sure you have everything. You need to meet your objective, from a wealth of convenient business services, to pleasurable dining and comfortable with our function and seminars. Our variety of 21 restaurants and lounges of Sawasdee &amp; Woraburi allow you and your colleagues to relax over a finemeal or just a light bite. Sawasdee &amp; Woraburi Services, aim to help companies and public institution improve their performance by enhancing employee and citizen''s well being.</span></p>', '<p><strong><span style="font-size: xx-large;">Facilities &amp; service</span></strong></p>\n<table border="0">\n<tbody>\n<tr>\n<td colspan="3">\n<p><strong>Every Comfort and Convenience under the sun</strong></p>\n<p style="padding-left: 30px;">For a rejuvenating treatment or massage steeped in the ancient Thai traditions, guests need look no further than Woraburi Phuket Spa. Whatever your favourite pastime, you will find it easy to indulge yourself thanks to these and other services and facilities.</p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Open air lobby</p>\n</li>\n<li>\n<p>Concierge service</p>\n</li>\n<li>\n<p>Swimming Pool</p>\n</li>\n<li>\n<p>Local call and Oversea call</p>\n</li>\n<li>\n<p>Fax</p>\n</li>\n<li>\n<p>Sip Bar &amp; Restaurant</p>\n</li>\n<li>\n<p>Saloon bar</p>\n</li>\n<li>\n<p>Internet corner</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>Laundry &amp; Dry cleaning</p>\n</li>\n<li>\n<p>Luggage storage</p>\n</li>\n<li>\n<p>Room service (24 hours)</p>\n</li>\n<li>\n<p>Safety deposit boxes (front desk&nbsp;) &nbsp;</p>\n</li>\n<li>\n<p>Sunset Pool Bar</p>\n</li>\n<li>\n<p>Car Park</p>\n</li>\n<li>\n<p>Elevator</p>\n</li>\n<li>\n<p>Tailor Shop</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>Beauty Salon</p>\n</li>\n<li>\n<p>Television in public area</p>\n</li>\n<li>\n<p>Tour desk</p>\n</li>\n<li>\n<p>Tourist information</p>\n</li>\n<li>\n<p>Wi-Fi Internet</p>\n</li>\n<li>\n<p>TUK TUK service (Tricycle car)</p>\n</li>\n<li>\n<p>Daily Room Cleaning</p>\n</li>\n<li>\n<p>DVD Player</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-13 10:50:24', NULL, '2013-02-13 11:08:26', NULL),
(30, 12, 'th', 'โรงแรมทิมเบอร์ เฮ้าส์ อ่าวนาง', 'โรงแรมทิมเบอร์-เฮ้าส์-อ่าวนาง', 'Timber House Resort ตั้งอยู่บนหาดอ่าวนาง ให้บริการห้องพักกว้างขวางพร้อมระเบียงส่วนตัว และมีวิวทิวทัศน์ของสระน้ำกลางแจ้ง หรือสวนเขตร้อน นอกจากนี้ยังมีห้องอาหาร สปาและที่จอดรถฟรี', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; <span style="font-size: x-large;">&nbsp;<strong> โรงแรมทิมเบอร์ เฮ้าส์ อ่าวนาง</strong></span>&nbsp;ตั้งอยู่บนหาดอ่าวนาง ให้บริการห้องพักกว้างขวางพร้อมระเบียงส่วนตัว และมีวิวทิวทัศน์ของสระน้ำกลางแจ้ง หรือสวนเขตร้อน นอกจากนี้ยังมีห้องอาหาร สปาและที่จอดรถฟรี&nbsp;รีสอร์ทตั้งอยู่ภายในบริเวณสวนหย่อม ห้องพักปรับอากาศที่ Timber House ตกแต่งด้วยเฟอร์นิเจอร์ไม้ มีทีวีระบบสัญญาณเคเบิล ตู้นิรภัย รวมถึงอุปกรณ์ชงชาและกาแฟเพื่อความสะดวกสบายของผู้เข้าพัก รวมถึงห้องน้ำส่วนตัวพร้อมเครื่องใช้ในห้องน้ำและเครื่องเป่าผม.&nbsp;C Spa มีทรีทเมนท์เพื่อความงามและใบหน้าไว้คอยให้บริการแก่ผู้เข้าพัก และยังมีโต๊ะบริการทัวร์ให้บริการกิจกรรมทางสันทนาการอย่างทัวร์ตกปลาและดำน้ำ ผู้เข้าพักสามารถนั่งเล่นข้างสระน้ำภูมิทัศน์กลางแจ้ง&nbsp;Fish Restaurant ให้บริการอาหารทะเลย่าง และบุฟเฟ่ต์อาหารไทยและอาหารยุโรปหลากหลายรายการ พร้อมวิวสวน ผู้เข้าพักสามารถใช้บริการรูมเซอร์วิสได้เช่นกัน.Timber House Resort อยู่ไม่ไกลจากตลาดนัดกลางคืนและสถานบันเทิงหลายแห่ง และใช้เวลาเดินทางโดยรถยนต์เพียง 30 นาที จากสนามบินนานาชาติกระบี่</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>บาร์/ผับ</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>สระว่ายน้ำ(สำหรับเด็ก)</p>\n</li>\n<li>\n<p>ห้องอบไอน้ำ</p>\n</li>\n<li>\n<p>LAN</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>ซาวน่า</p>\n</li>\n<li>\n<p>WiFi (เสียค่าใช้จ่าย)</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>บริการรถรับ-ส่งถึงสนามบิน</p>\n</li>\n<li>\n<p>พนังงานต้อนรับ</p>\n</li>\n<li>\n<p>อำนวยความสะดวกคนพิการ</p>\n</li>\n<li>\n<p>จาคุซซี่</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>สปา</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-12 16:14:59', NULL, '2013-02-18 16:14:28', NULL),
(31, 14, 'th', 'โรงแรม พีพี ชาลี บีช รีสอร์ท', 'โรงแรม-พีพี-ชาลี-บีช-รีสอร์ท', 'PP Charlie Beach Resort อยู่ห่างจากท่าเรือคลองจิหลาดในจังหวัดกระบี่โดยใช้เวลาเดินทางโดยเรือ 1.5 ชั่วโมง รีสอร์ทมีสระว่ายน้ำว่ายน้ำกลางแจ้ง และมีบริการอินเทอร์เน็ตไร้สาย (Wi-Fi) ฟรีในพื้นที่สาธารณะ', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style="font-size: x-large;"><strong>โรงแรม พีพี ชาลี บีช รีสอร์ท</strong></span>&nbsp;อยู่ห่างจากท่าเรือคลองจิหลาดในจังหวัดกระบี่โดยใช้เวลาเดินทางโดยเรือ 1.5 ชั่วโมง รีสอร์ทมีสระว่ายน้ำว่ายน้ำกลางแจ้ง และมีบริการอินเทอร์เน็ตไร้สาย (Wi-Fi) ฟรีในพื้นที่สาธารณะ&nbsp;ผู้เข้าพักสามารถเดินทางยังตัวเมืองกระบีได้จากท่าเรือคลองจิหลาด โดยใช้เวลาเดินทางโดยรถยนต์ไปยังท่าเรือ 5 นาที และท่านยังสามารถเดินทางโดยเรือมายัง PP Charlie Beach Resort ได้จากท่าเรือรัชดาโดยใช้เวลา 1.5 นาทีห้องพักปรับอากาศที่รีสอร์ทแต่ละห้องมีเคเบิลทีวีและห้องน้ำพร้อมฝักบัว&nbsp;รีสอร์ทมีแผนกต้อนรับส่วนหน้าที่เปิดตลอด 24 ชั่วโมงและบริการรถรับส่งจากสนามบินกระบี่ไปยังท่าเรือคลองจิหลาดพร้อมค่าธรรมเนียมเพิ่มเติม&nbsp;ห้องอาหาร PP Charlie มีบริการอาหารไทยและนานาชาติ</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>wi-fi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ไนท์คลับ</p>\n</li>\n<li>\n<p>คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>จุดบริการรถทัวร์</p>\n</li>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>บริการพี่เลี้ยงเด็ก</p>\n</li>\n<li>\n<p>บาร์/ผับ</p>\n</li>\n<li>\n<p>บาร์ริมสระน้ำ</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>พนักงานต้อนรับ</p>\n</li>\n<li>\n<p>พื้นที่สูบบุหรี่</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>ห้องแฟมิลี่รูม</p>\n</li>\n<li>\n<p>กีฬาทางน้ำ</p>\n</li>\n<li>\n<p>กีฬาทางน้ำ(มีเครื่องยนต์)</p>\n</li>\n<li>\n<p>สระว่ายน้ำ(สำหรับเด็ก)</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n<li>\n<p>สวน</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-12 16:19:27', NULL, '2013-02-18 12:01:58', NULL),
(32, 14, 'en', 'PP CHARLIE BEACH RESORT', 'pp-charlie-beach-resort', 'PP Charlie Beach Resort is 1.5 hours boat ride from Klong Ji Rad Pier, Krabi. The resort boasts an outdoor swimming pool. Free Wi-Fi in the public area is provided.', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style="font-size: x-large;"><strong> PP Charlie Beach Resort</strong> </span>is 1.5 hours boat ride from Klong Ji Rad Pier, Krabi. The resort boasts an outdoor swimming pool. Free Wi-Fi in the public area is provided.&nbsp;Guests can travel to Krabi Town from Klong Ji Rad Pier within a 5-minute drive. PP Charlie Beach Resort can be reached from Ratchada Pier in 1.5 hours by boat.&nbsp;Each room at the resort features an air conditioning, a cable TV and an en suite bathroom with shower facilities.&nbsp;The resort offers 24-hour front desk service and shuttle service from Krabi Airport to Klong Ji Rad Pier can be arranged at an additional cost.&nbsp;PP Charlie Restaurant serves both Thai and International cuisines.</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">Facilities&amp;Services</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>babysitting</p>\n</li>\n<li>\n<p>bar/pub</p>\n</li>\n<li>\n<p>coffee shop</p>\n</li>\n<li>\n<p>concierge</p>\n</li>\n<li>\n<p>family room</p>\n</li>\n<li>\n<p>laundry service/dry cleaning</p>\n</li>\n<li>\n<p>nightclub</p>\n</li>\n<li>\n<p>poolside bar</p>\n</li>\n<li>\n<p>restaurant</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>safety deposit boxes</p>\n</li>\n<li>\n<p>smoking area</p>\n</li>\n<li>\n<p>tours</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n<li>\n<p>garden</p>\n</li>\n<li>\n<p>outdoor pool</p>\n</li>\n<li>\n<p>pool(kids)</p>\n</li>\n<li>\n<p>water sports (motorized)</p>\n</li>\n<li>\n<p>water sports (non-motorized)</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>', '', '', '2013-02-12 16:21:23', NULL, '2013-02-15 10:40:51', NULL);
INSERT INTO `ci_hotel_translate` (`hott_id`, `hott_hotel_id`, `hott_lang`, `hott_name`, `hott_url`, `hott_short_description`, `hott_description`, `hott_detail`, `hott_included`, `hott_remark`, `hott_cr_date`, `hott_cr_uid`, `hott_lu_date`, `hott_lu_uid`) VALUES
(38, 17, 'th', 'โรงแรมวรบุรี ภูเก็ต', 'โรงแรมวรบุรี-ภูเก็ต', '', '<p><span style="font-size: xx-large;"><strong>&nbsp; &nbsp; "วรบุรี"</strong></span>&nbsp;คือดินแดนแสนสงบ เป็นดั่งอาณาจักรแสนรื่นรมย์ของเหล่านางฟ้าที่สุขสำราญได้อย่างไม่มีที่สิ้นสุดงดงามสมดั่งนาม "วรบุรี" เพียงก้าวแรกที่ข้ามผ่านเข้าสู่วรบุรี ภูเก็ต รีสอร์ท แอนด์ สปา คุณจะสัมผัสได้ถึงความปีติอิ่มเอมใจที่ถูกพัดพามากับสายลมเอื่อย ๆ โชยระเรื่อยไปทั่วทุกแห่ง สายลมที่พัดเบา ๆ จากระฆังศรีวิชัยอันงดงามโดดเด่นที่ตั้งอยู่บริเวณกลางล๊อบบี้นั้นเปรียบได้กับสัญลักษณ์แห่งไมตรีจิตของชาวใต้ที่เราต่างรับรู้กันมาช้านาน</p>', '<table border="0">\n<tbody>\n<tr>\n<td colspan="3">\n<p><span style="font-size: x-large;"><strong>สิ่งอำนวยความสะดวก</strong></span></p>\n<p style="padding-left: 30px;">หากคุณกำลังมองหาวิธีบำบัดเพื่อความผ่อนคลายหรือหลงใหลในการนวดแผนไทยโบราณ ไม่ต้องเสียเวลามองหาอีกต่อไป เพราะที่ &ldquo;วรบุรี สุขุมวิท โฮเทล แอนด์ รีสอร์ท&rdquo; เราได้รวมทุกความสะดวกสบายภายใต้แสงอาทิตย์นี้ไว้อย่างครบครันทุกสิ่งที่คุณมองหา และทุกความต้องการของคุณจะถูกเติมเต็ได้ที่นี่ด้วยบริการต่าง ๆ ของเรา</p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>โถงล๊อบบี้เปิดรับลม</p>\n</li>\n<li>\n<p>บริการขนกระเป๋า</p>\n</li>\n<li>\n<p>สระว่ายน้ำ</p>\n</li>\n<li>\n<p>โทรศัพท์ภายในประเทศ และ ต่างประเทศ</p>\n</li>\n<li>\n<p>แฟกซ์/โทรสาร</p>\n</li>\n<li>\n<p>ซิป บาร์ แอนด์ เรสตัวรองท์</p>\n</li>\n<li>\n<p>ซาลูน บาร์</p>\n</li>\n<li>\n<p>มุมอินเตอร์เน็ด</p>\n</li>\n<li>\n<p>ซักรีด และ ซักแห้ง</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>บริการห้องเก็บสัมภาระ</p>\n</li>\n<li>\n<p>บริการรูมเซอร์วิส (ตลอด 24 ชั่วโมง)</p>\n</li>\n<li>\n<p>ตู้นิรภัยรับฝากของ (บริเวณต้อนรับส่วนหน้า)</p>\n</li>\n<li>\n<p>อินเตอร์เน็ตแบบไร้สาย</p>\n</li>\n<li>\n<p>ซันเซ็ท พูล บาร์</p>\n</li>\n<li>\n<p>ที่จอดรถยนต์</p>\n</li>\n<li>\n<p>ลิฟท์</p>\n</li>\n<li>\n<p>ร้านตัดเสื้อ</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>ร้านเสริมสวย</p>\n</li>\n<li>\n<p>บริการโทรทัศน์บริเวณโถงกลาง</p>\n</li>\n<li>\n<p>โต๊ะบริการนำเที่ยว</p>\n</li>\n<li>\n<p>บริการให้ข้อมูลการท่องเที่ยว</p>\n</li>\n<li>\n<p>บริการรถลีมูซีน</p>\n</li>\n<li>\n<p>บริการรถตุ๊ก ตุ๊ก</p>\n</li>\n<li>\n<p>ทำความสะอาดห้องพักทุกวัน</p>\n</li>\n<li>\n<p>เครื่องเล่นดีวีดี</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-13 10:28:18', NULL, '2013-02-18 09:22:29', NULL),
(46, 21, 'th', 'โรงแรมกะตะลัคกี้ วิลล่า & พูล แอคเซส', 'โรงแรมกะตะลัคกี้-วิลล่า-amp-พูล-แอคเซส', '  โรงแรมกะตะลัคกี้ วิลล่า ตั้งอยู่ห่างจากหาดกะตะอันเงียบสงบเพียง 500 ม. ให้บริการที่พักหรูหราท่ามกลางธรรมชาติเขตร้อน', '<blockquote>\n<p>&nbsp; &nbsp; โรงแรมกะตะลัคกี้ วิลล่า&nbsp;ตั้งอยู่ห่างจากหาดกะตะอันเงียบสงบเพียง 500 ม. ให้บริการที่พักหรูหราท่ามกลางธรรมชาติเขตร้อน ประกอบด้วยสระว่ายน้ำกลางแจ้งอันโดดเด่นและสวยงาม มีบริการนวดและที่จอดรถบริการฟรี ตลอดจนบริการรถรับส่งเที่ยวเดียวไปยังหาดกะตะฟรี ซึ่งให้บริการในเวลา 09:00 น. - 17:00 น. วิลล่าทรงไทยอันทันสมัย​​ที่ได้รับการตกแต่งมาเป็นอย่างดี</p>\n</blockquote>', '<table border="0">\n<tbody>\n<tr>\n<td colspan="2">\n<p><strong><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n<li>\n<p>บริการรถรับ-ส่งถึงสนามบิน</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>สระว่ายน้ำ (สำหรับเด็ก)</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n<li>\n<p>WiFi (เสียค่าใช้จ่าย)</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n<li>\n<p>บาร์ริมสระน้ำ</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-14 14:10:58', NULL, '2013-02-18 11:10:44', NULL),
(50, 23, 'en', 'Tony Lodge', 'tony-lodge', 'Tony Lodge is a little boutique hotel located in the serene Khao Lak of Phang Nga.', '<p style="padding-left: 30px;"><span style="font-size: x-large;"><strong>&nbsp; &nbsp; &nbsp;Tony Lodge</strong></span> is a little boutique hotel located in the serene Khao Lak of Phang Nga. Encircled by the green leaves of the lush tropical forests, the property boasts stunning seaside surroundings of emerald waters and shimming white sand. Experience the lavish lifestyle with unparalleled service and warm Thai hospitality.&nbsp;Each of their comfortable air-conditioned guestrooms consists of a range of modern quality amenities ensuring guests&rsquo; convenience and satisfaction throughout their stay. All come with private balcony for your peaceful moment with the spectacular vista. Services provided on-site include car rentals, city tour, and transfer to/from Phuket Airport as well as transfer to/from the famous Patong Beach.</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p style="text-align: center;"><span style="font-size: xx-large;">Facilities&amp;Services</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>massage</p>\n</li>\n<li>\n<p>Free WiFi access</p>\n</li>\n<li>\n<p>airport transfer</p>\n</li>\n<li>\n<p>bicycle rental</p>\n</li>\n<li>\n<p>laundry service/dry cleaning</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</td>\n<td>\n<ul>\n<li>\n<p>tours</p>\n</li>\n<li>\n<p>outdoor pool</p>\n</li>\n<li>\n<p>pool (kids)</p>\n</li>\n<li>\n<p>safety deposit boxes</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-18 14:47:19', NULL, '2013-02-19 11:15:52', NULL),
(40, 18, 'th', 'โรงแรมป่าตอง รีสอร์ท ', 'โรงแรมป่าตอง-รีสอร์ท', ' สามารถเติมเต็มความสุขในวันพักผ่อนของท่านอย่างสมบูรณ์แบบ กับความสะดวกสบายด้วยเครื่องอำนวยความสะดวกครบครัน ภายในห้องพักประดับตกแต่งสวยงามลงตัว', '<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; ป่าตอง รีสอร์ท</strong><span>&nbsp;สามารถเติมเต็มความสุขในวันพักผ่อนของท่านอย่างสมบูรณ์แบบ กับความสะดวกสบายด้วยเครื่องอำนวยความสะดวกครบครัน ภายในห้องพักประดับตกแต่งสวยงามลงตัว มีบริการต่างๆ ทั้งสระน้ำ ห้องอบไอน้ำสมุนไพร ห้องเกมส์ และสนามเทนนิส นอกจากนี้ท่านยังสามารถลิ้มรสชาติอาหารทั้งแบบพื้นบ้าน และอาหารนานาชาติ อาหารอิตาเลียนเลิศรส อาหารญี่ปุ่นที่ภัตตาคารยูริ สเต็กเนื้อนำเข้าที่ร้านรูฟ ทอป สเต็ก เฮาส์ และเอเมอรอลคอฟฟี่ชอป ยังมีกิจกรรมต่างๆเพื่อความสุขทั้งการ ขี่หลังช้าง และชมวิวรอบเกาะกับบรรยากาศที่สวยงามของเกาะภูเก็ต&nbsp;</span></p>', '<table border="0">\n<tbody>\n<tr>\n<td colspan="2">\n<p><strong><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wi-Fi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ตู้นิรภัย</p>\n</li>\n<li>\n<p>บริการพี่เลี้ยงเด็ก</p>\n</li>\n<li>\n<p>บาร์/ผับ</p>\n</li>\n<li>\n<p>ร้านอาหาร</p>\n</li>\n<li>\n<p>ลิฟท์</p>\n</li>\n<li>\n<p>ห้องประชุม</p>\n</li>\n<li>\n<p>ร้านเสริมสวย</p>\n</li>\n<li>\n<p>รูมเซอร์วิส</p>\n</li>\n<li>\n<p>คอฟฟี่ช็อป</p>\n</li>\n<li>\n<p>จุดบริการทัวร์</p>\n</li>\n<li>\n<p>บริการซักรีด/ซักแห้ง</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>บริการรถรับ-ส่งถึงสนามบิน</p>\n</li>\n<li>\n<p>พนักงานต้อนรับ&nbsp;</p>\n</li>\n<li>\n<p>ร้านค้า</p>\n</li>\n<li>\n<p>สระว่ายน้ำ (สำหรับเด็ก)</p>\n</li>\n<li>\n<p>สวน</p>\n</li>\n<li>\n<p>ห้องอบไอน้ำ</p>\n</li>\n<li>\n<p>ซาวน่า</p>\n</li>\n<li>\n<p>สนามเทนนิส</p>\n</li>\n<li>\n<p>จาคุซซี</p>\n</li>\n<li>\n<p>บริการนวด</p>\n</li>\n<li>\n<p>สระว่ายน้ำกลางแจ้ง</p>\n</li>\n<li>\n<p>WiFi (เสียค่าใช้จ่าย)</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-13 14:40:30', NULL, '2013-02-13 16:03:41', NULL),
(41, 19, 'th', 'โรงแรมเอพีเค รีสอร์ท', 'โรงแรมเอพีเค-รีสอร์ท', 'โรงแรมเอพีเค รีสอร์ท ตั้งอยู่ห่างจากหาดป่าตองออกไป 10 นาทีโดยรถยนต์ ท่านสามารถเดินไปศูนย์การค้าจังซีลอนได้ภายใน 5 นาที ห้องพักปรับอากาศตกแต่งด้วยเฟอร์นิเจอร์ไม้สีเข้มทันสมัย', '<p>&nbsp; &nbsp; &nbsp; &nbsp;โรงแรมเอพีเค รีสอร์ท ตั้งอยู่ห่างจากหาดป่าตองออกไป 10 นาทีโดยรถยนต์ ท่านสามารถเดินไปศูนย์การค้าจังซีลอนได้ภายใน 5 นาที ห้องพักปรับอากาศตกแต่งด้วยเฟอร์นิเจอร์ไม้สีเข้มทันสมัย มีลานอาบแดดของโรงแรมมีวิวหาดป่าตองอันกว้างไกลสวยงาม นอกจากนี้ท่านยังสามารถวางแผนการท่องเที่ยวในแต่ละวันได้ที่โต๊ะบริการทัวร์ หรือจะใช้บริการนวดและทรีทเมนท์สปาก็ได้ จาก โรงแรมเอพีเค รีสอร์ท&nbsp;ท่านสามารถเดินไปยังแหล่งบันเทิงยามค่ำคืนบนซอยบางลาได้โดยใช้เวลาเพียง 5 นาที ส่วนสนามบินนานาชาติภูเก็ตอยู่ห่างออกไป 45 นาทีโดยรถยนต์</p>', '<p>.....</p>', '', '', '2013-02-13 15:35:18', NULL, '2013-02-18 16:51:18', NULL),
(42, 18, 'en', 'Patong Resort Hotel', 'patong-resort-hotel', 'Patong Resort comprising of 111 Deluxe rooms, 11 Premium Deluxe rooms, 10 Executive rooms and 2 Grand Suites', '<p>&nbsp; &nbsp; &nbsp; Patong Resort&nbsp;comprising of 111 Deluxe rooms, 11 Premium Deluxe rooms, 10 Executive rooms and 2 Grand Suites, some are overlooking Patong Bay and situated in the elegant high-rise building with the main lobby hall designed and decorated in a unique Chino-Portugese architecture. In addition, there are 70 Premium Deluxe rooms in wing 1 set in the lush tropical gardens with modern low-rise building, 22 Deluxe rooms in wing 3 and 99 Standard rooms in wing 2 and 3, located in the greenery area, these budget rooms are in the low-rise building - the old fashion resort style. All 325 rooms are equipped with modern facilities.</p>', '<table border="0">\n<tbody>\n<tr>\n<td colspan="2">\n<p><strong><span style="font-size: xx-large;">Facilities</span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>bar/pub</p>\n</li>\n<li>\n<p>airport transfer</p>\n</li>\n<li>\n<p>babysitting</p>\n</li>\n<li>\n<p>concierge</p>\n</li>\n<li>\n<p>coffee shop</p>\n</li>\n<li>\n<p>laundry service/dry cleaning</p>\n</li>\n<li>\n<p>elevator</p>\n</li>\n<li>\n<p>meeting facilities</p>\n</li>\n<li>\n<p>room service</p>\n</li>\n<li>\n<p>safety deposit boxes</p>\n</li>\n<li>\n<p>shops</p>\n</li>\n<li>\n<p>tours</p>\n</li>\n<li>\n<p>restaurant</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>massage</p>\n</li>\n<li>\n<p>jacuzzi</p>\n</li>\n<li>\n<p>Outdoor Pool</p>\n</li>\n<li>\n<p>sauna</p>\n</li>\n<li>\n<p>steamroom</p>\n</li>\n<li>\n<p>garden</p>\n</li>\n<li>\n<p>pool (kids)</p>\n</li>\n<li>\n<p>tennis</p>\n</li>\n<li>\n<p>wifi access (charged)</p>\n</li>\n<li>\n<p>car park</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n<li>\n<p>salon</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-13 16:09:49', NULL, '2013-02-13 16:27:54', NULL),
(43, 19, 'en', 'APK Resort Hotel', 'apk-resort-hotel', 'This stylish, brand new modern hotel, is like a cozy nest in the bustling area of Patong beach area.', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;This stylish, brand new modern hotel, is like a cozy nest in the bustling area of Patong beach area. With our facilities we have to offer, travelers can feel relaxed with the idyllic ambience. Our hotel is determined to provide affordable yet memorable accommodation for your repose</p>', '<table border="1">\n<tbody>\n<tr>\n<td style="background-color: #ffffcc; border: 1px solid #000000;" colspan="2"><strong><span style="font-size: xx-large;">Facilities / Services</span></strong></td>\n</tr>\n<tr>\n<td style="border: 1px solid #000000;">\n<ul>\n<li>\n<p>Doctor and ambulance on call</p>\n</li>\n<li>\n<p>Van+ driver hire (on request)</p>\n</li>\n<li>\n<p>Rooftop bar</p>\n</li>\n<li>\n<p>Safety box (Free of charge)</p>\n</li>\n<li>\n<p>Ton Tong Restaurant</p>\n</li>\n<li>\n<p>&nbsp;Daily housekeeping service</p>\n</li>\n<li>\n<p>Electricity 220V/50 cycles</p>\n</li>\n<li>\n<p>Rooftop swimming pool</p>\n</li>\n</ul>\n</td>\n<td style="border: 1px solid #000000;">\n<ul>\n<li>\n<p>Tour counter</p>\n</li>\n<li>\n<p>24 hours front desk</p>\n</li>\n<li>\n<p>CCTV</p>\n</li>\n<li>\n<p>Wi-Fi access</p>\n</li>\n<li>\n<p>Motorbike rental</p>\n</li>\n<li>\n<p>Sun bathing area</p>\n</li>\n<li>\n<p>Facsimile service</p>\n</li>\n<li>\n<p>Bellboy</p>\n</li>\n<li>\n<p>Postal services</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-13 16:49:43', NULL, '2013-02-14 16:38:12', NULL),
(44, 20, 'th', 'โรงแรมปาล์มไมร่า ป่าตอง รีสอร์ท', 'โรงแรมปาล์มไมร่า-ป่าตอง-รีสอร์ท', 'ประสบการณ์ในวันพักผ่อนอันแสนวิเศษ เริ่มต้นจากสถานที่ที่น่าประทับใจ ', '<p>ปาล์มไมร่า ป่าตอง รีสอร์ท แบ่งออกเป็น 2 โซน ได้แก่ โซนที่พักสไตล์ศิลปะไทยดั่งเดิม และโซนที่พักตกแต่งแบบร่วมสมัย ทั้งหมด 90 ห้อง หลากหลายรูปแบบให้เลือก ทั้งห้องสตูดิโอ, ห้องสวีท, ห้องชุด 2 ห้องนอนพร้อมครัวและระเบียงส่วนตัว เหมาะสำหรับการพักผ่อนแบบหมู่คณะ, คู่รักหรือครอบครัวภายในบริเวณรีสอร์ท มีร้านอาหาร&rdquo;โคซี่&rdquo; ที่พร้อมให้บริการคุณทั้งอาหารไทยและอาหารนานาชาติ ตั้งอยู่ริมสระว่ายน้ำ ขนาดความยาวกว่า 30 เมตร ตกแต่งด้วยน้ำตกจำลองที่ด้านสุดของสระ ให้มุมมองที่งดงามเคล้ากับเสียงธารน้ำตกอันอ่อนโยน</p>', '<table border="0">\n<tbody>\n<tr>\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>สระว่ายน้ำพร้อมจากุซซี่</p>\n</li>\n<li>\n<p>สระว่ายน้ำสำหรับเด็ก</p>\n</li>\n<li>\n<p>ร้านอาหารริมสระน้ำ (เปิดบริการ 7:00 ถึง 22:00 น.)</p>\n</li>\n<li>\n<p>ห้องฟิตเนส</p>\n</li>\n<li>\n<p>บาร์เครื่องดื่ม</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>บริการรับจองรถรับส่งในตัวเมืองภูเก็ตและสนามบิน</p>\n</li>\n<li>\n<p>สวนหย่อม</p>\n</li>\n<li>\n<p>บริการนวดแผนไทย</p>\n</li>\n<li>\n<p>รูมเซอร์วิช</p>\n</li>\n<li>\n<p>ที่จอดรถกว้างขวาง</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-14 09:44:41', NULL, '2013-02-14 10:16:30', NULL),
(45, 20, 'en', 'Palmyra Patong Resort', 'palmyra-patong-resort', 'Great holiday experience starts from having a great place to stay, and this is what Palmyra Patong Resort is all about.', '<p class="slogan">Divided into two zones, on one side representing the traditional Thai-style accommodation and the other the contemporary boutique style; a choice of 90 rooms ranging from studio, 1-bedroom suite to 2-bedroom villa with kitchen and private balcony; ideal for couples, friends and family.</p>\n<p>Our pool side restaurant, serving both Thai and international fusion food, is cozily situated by the beautifully designed swimming pool, stretching more than 30 meters long and offering a great ambience for guests to enjoy. Nesting at the end of the pool, an artistically designed waterfall gives you both breathtaking views and soothing sound of the gentle waterfall.</p>', '<table border="0">\n<tbody>\n<tr>\n<td colspan="2">\n<p><span style="font-size: xx-large;"><strong>Resort facilities for you:</strong></span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Swimming pool with jacuzzi</p>\n</li>\n<li>\n<p>Kid pool</p>\n</li>\n<li>\n<p>Poolside restaurant (7am &ndash; 10pm)</p>\n</li>\n<li>\n<p>Fitness room</p>\n</li>\n<li>\n<p>Liquid bar</p>\n</li>\n</ul>\n</td>\n<td>\n<ul>\n<li>\n<p>Airport transfer services</p>\n</li>\n<li>\n<p>Garden</p>\n</li>\n<li>\n<p>Thai massage service</p>\n</li>\n<li>\n<p>Room service</p>\n</li>\n<li>\n<p>Ample parking</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-14 10:23:15', NULL, '2013-02-19 14:17:56', NULL),
(51, 23, 'th', 'โรงแรมโทนี ลอดจ์', 'โรงแรมโทนี-ลอดจ์', 'โรงแรม โทนี่ ลอดจ์ เป็นรีสอร์ทที่โอบล้อมด้วยแมกไม้เขียวขจีภายใต้แสงแดดอันอบอุ่น ตั้งอยู่บนหาดทรายสีขาวนวล ริมท้องทะเลและเกลียวคลื่นสงบบนหาดคึกคัก เขาหลัก จังหวัดพังงา', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; <span style="font-size: x-large;"><strong>&nbsp; โรงแรม โทนี่ ลอดจ์</strong> </span>เป็นรีสอร์ทที่โอบล้อมด้วยแมกไม้เขียวขจีภายใต้แสงแดดอันอบอุ่น ตั้งอยู่บนหาดทรายสีขาวนวล ริมท้องทะเลและเกลียวคลื่นสงบบนหาดคึกคัก เขาหลัก จังหวัดพังงา ห้องพักทุกห้องมีเฉลียงเป็นส่วนตัว ให้ท่านได้เดินออกสู่บริเวณนั่งเล่นภายนอกได้อย่างสะดวกสบาย ห้องพักทั้งหมดพร้อมสรรพด้วยสิ่งอำนวยความสะดวกที่ทันสมัยที่สุด เพื่อรับประกันวันพักผ่อนอันเป็นสุข ภายในห้องพักมีเครื่องปรับอากาศ เคเบิลทีวี เครื่องทำน้ำอุ่นและน้ำเย็น เป็นต้น ขอให้เราได้เติมเต็มความสุขในวันพักผ่อนของท่านให้เป็นไปตามที่ท่านต้องการ ที่นี่ โรงแรม โทนี่ ลอดจ์ เขาหลัก พร้อมแล้วที่จะให้ท่านสัมผัสความรู้สึกแบบราชา</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2"><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></td>\n</tr>\n<tr>\n<td>\n<table style="height: 139px; width: 140px;" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td>\n<ul>\n<li>Wi-Fi ในพื้นที่สาธารณะ</li>\n<li>ตู้นิรภัย</li>\n<li>สระว่ายน้ำ (สำหรับเด็ก)</li>\n<li>ฟรี WiFi</li>\n<li>จักรยานให้เช่า</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n</td>\n<td>\n<ul>\n<li>จุดบริการทัวร์</li>\n<li>บริการซักรีด/ซักแห้ง</li>\n<li>บริการรถรับ-ส่งถึงสนามบิน</li>\n<li>บริการนวด</li>\n<li>สระว่ายน้ำกลางแจ้ง</li>\n</ul>\n&nbsp;&nbsp;&nbsp;</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-18 15:02:46', NULL, '2013-02-18 15:56:04', NULL),
(52, 24, 'th', ' โรงแรมเขาหลักยูธคลับ', 'โรงแรมเขาหลักยูธคลับ', '  เขาหลักยูธคลับ ตั้งอยู่บนหาดนางทอง ห่างจากสนามบินนานาชาติภูเก็ต 1 ชั่วโมงหากเดินทางด้วยรถยนต์ ', '<p style="padding-left: 30px;"><span id="hp_hotel_name" class="fn"><span style="font-size: x-large;"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;เขาหลักยูธคลับ</strong></span>&nbsp;</span><span style="font-size: 10px; font-weight: normal;">ตั้งอยู่บนหาดนางทอง ห่างจากสนามบินนานาชาติภูเก็ต 1 ชั่วโมงหากเดินทางด้วยรถยนต์ มีห้องอาหาร 2 ห้อง และบังกะโลปรับอากาศ&nbsp;ห้องพักมีระเบียงส่วนตัว ฝักบัวน้ำอุ่น ตู้เย็น และตู้นิรภัย&nbsp;สิ่งอำนวยความสะดวกที่&nbsp;</span><span id="hp_hotel_name" class="fn">เขาหลักยูธคลับ</span>ได้แก่ บริการเช่ารถยนต์และจักรยานยนต์ บริการซักรีด และบริการที่จอดรถฟรี มีห้องอาหารและบาร์ในสถานที่<span id="hp_hotel_name" class="fn">เขาหลักยูธคลับ</span>ตั้งอยู่ใกล้กับถนนช้อปปิ้งใจกลางเมืองและหาดนางทองโดยใช้เวลาเดิน 3 นาทีและ 5 นาทีตามลำดับ</p>\n<p class="item">&nbsp;</p>', '', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p><span style="font-size: xx-large;">สิ่งอำนวยความสะดวก</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Wi-Fi ในพื้นที่สาธารณะ</p>\n</li>\n<li>\n<p>ฟรี WiFi</p>\n</li>\n<li>\n<p>ที่จอดรถ</p>\n</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p><br /><br /></p>', '', '2013-02-18 15:41:14', NULL, '2013-02-18 16:57:48', NULL),
(53, 24, 'en', 'Khaolak Youth Club', 'khaolak-youth-club', 'Khaolak Youth Club is situated along NangThong Beach area, a 1-hour drive from Phuket International Airport.', '<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style="font-size: x-large;"><strong>Khaolak Youth Club</strong></span> is situated along NangThong Beach area, a 1-hour drive from Phuket International Airport. It features 2 dining options and air-conditioned bungalows.&nbsp;Rooms come with a private balcony and hot shower. A refrigerator and safety deposit box are also provided.&nbsp;Facilities at the Khaolak Youth Club include car rental, bicycle rental and laundry services. Free parking is also available. Dining options include the on-site restaurant and bar.&nbsp;Khaolak youth Club is a 3-minute walk to the town centre&rsquo;s shopping street and a 5-minute walk to Nang Thong beach.</p>', '<table border="1">\n<tbody>\n<tr style="background-color: #ffffcc;">\n<td colspan="2">\n<p style="text-align: center;"><span style="font-size: xx-large;">Facilities&amp;Services</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<ul>\n<li>\n<p>Free WiFi access</p>\n</li>\n<li>\n<p>Wi-Fi in public areas</p>\n</li>\n<li>\n<p>car park</p>\n</li>\n</ul>\n<p>&nbsp;</p>\n</td>\n</tr>\n</tbody>\n</table>', '', '', '2013-02-18 15:53:32', NULL, '2013-02-18 15:53:32', NULL);
